INSERT INTO `vcos_article_language` VALUES ('1', '81', 'zh_cn', '中华泰山封禅大典25日与泰安观众再见', '<p>　中华泰山网11月11日讯(记者 张越嘉)中华泰山网记者从泰山封禅大典获悉，《中华泰山·封禅大典》大型实景演出2015年演出季将于9月25日结束，25日为今年最后一场封禅祈福盛宴，演出将于明年3月恢复。<br/></p>', '中华泰山封禅大典'), ('2', '83', 'zh_cn', '船长刘仁才给您的重要信息！！！', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp; 我们将继续朝着水流湍急的中国海域的东部航行。在能见度较好的情况下。我们会隐约看到济州岛的南部。前往烟台的航行期间，特别是在某些特定的区域，我们会遇到许多密集的渔船，特别是在夜间，渔船上的灯光会照亮我们航行的道路。</span></p>', '重要信息'), ('25', '83', 'en', 'fCaptain Liu Rencai gives you important information!!!', '<p class=\"ordinary-output target-output clearfix\"><span class=\"\">We will continue to sail towards the fast flowing waters of the eastern China.</span><span class=\"\"> In the case of better visibility.</span> We&#39;d vaguely see the southern part of Jeju Island.<span class=\"\"> During the voyage to Yantai, especially in some particular areas, we will encounter many intensive fishing vessels.</span> </p><p><br/></p>', 'important information'), ('27', '85', 'zh_cn', '领略阿拉伯海湾中东风情', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp; 神秘的中东风情，奢华的阿拉伯体验，成为邮轮旅游的新宠。近日，2014年迪拜商业及旅游业推广局“阿拉伯海湾邮轮中国区路演”在广州W酒店举行。迪拜作为中东地区首屈一指的邮轮目的地，到中国来推广邮轮产品尚属首次。</span></p>', '迪拜成邮轮新宠'), ('29', '87', 'zh_cn', '海上盛会', '<p>根据邮轮的净重、长度和载客量，为大家盘点世界级超大型邮轮前十名，造型绚丽极致奢华。<br/>海洋魅力号邮轮于2010年制造，比同公司海洋绿洲号长2英寸(约5厘米)，成为目前世界上最大的邮轮。这艘邮轮为图库尔船厂建造的一系列世界上最大的邮轮中的第二艘邮轮。第一艘是海洋绿洲号，两艘邮轮堪称姐妹船。<br/>海洋绿洲号邮轮于2009年11月下海进行处女航，当它在海上航行时，它就像是一座“旅行的城市”，有37个酒吧和20个餐厅。海洋绿洲号邮轮上拥有一片开阔的露天广场，两边则为带有阳台的客房。海洋绿洲号耗资14亿美元，比泰坦尼克号还要大3倍多。</p>', '最豪华的邮轮的聚首'), ('31', '89', 'zh_cn', '中加最长10年签证实行免面谈免留指纹', '<p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">会上，新京报记者得到提问机会，就读者关心的签证政策和海外出行便利、权益保护的措施向外交部部长王毅提问。新京报记者 陈杰 摄</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">昨日，外交部长王毅表示，中国和加拿大就互发有效期最长为10年的签证达成一致，9日起实施。这是继去年11月中美达成长期多次签证互惠安排之后，又一发达国家就签证便利化与中国达成长期机制性安排。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">9日起中加互发最长10年签证</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">据悉，中国和加拿大双方同意，自2015年3月9日起互为前往对方国家从事商务、旅游、探亲活动的对方公民颁发长期多次签证。只要护照有效期足够，签证有效期最长可达10年。这一互惠安排与两国良好的战略伙伴关系密不可分。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">近\r\n年来，双方高层和各级别交往频繁，经贸合作规模不断扩大。2013年，中加人员往来近120万人次，中国在加留学生近10万。加拿大是中国境外投资第二大\r\n目的地国，中国是加第二大贸易伙伴、第二大进口来源地和第二大出口市场，是加最大留学生来源国和海外游客增长最快国，中文已成为加第三大语言。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">在此背景下，中加两国政府顺应民意，达成签证互惠安排，将进一步拓宽两国各领域交往渠道，给两国人民带来实实在在的便利和好处。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">据了解，根据对等互惠原则，中加双方还将各自相关签证的单、多次签证收费统一调整为100加元和相应的人民币。双方对签证申请人均提供免面谈和免留指纹的便利。拿到多次签证后，就意味着可以随时拿起护照，来一场说走就走的旅行。</p><p><br/></p>', '旅游福利'), ('33', '91', 'zh_cn', '海上音乐节', '<p>伴随着窗外海水拍打声醒来，崭新的一天开始，站在甲板上呼吸着海上的空气，血液和心肺得到一种透析，此刻，心中只有那片深蓝，像人鱼公主被海上美丽的歌声吸引，体验一场海上美丽的音乐盛宴！<br/></p>', '海上的音乐盛宴'), ('39', '95', 'zh_cn', '三大邮轮集团全球CEO首次齐聚CCS10', '<p style=\"text-indent:22.0pt;\"><span style=\"font-size:11.0pt;line-height:150%;font-family:\" span=\"\">13-15</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">日，国家旅游局和中国交通运输协会共同主办、中国交通运输协会邮轮游艇分会（</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\" span=\"\">CCS10</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">）将在上海虹口举办。本届大会主题是“邮轮·海上生活新时尚”。</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\" p=\"\" span=\"\">8</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">月国务院出台的《关于进一步促进旅游投资和消费的若干意见》，在CCS10</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">同期特别主办首次全国邮轮旅游推进会，必将在国内外旅游界产生重大影响。</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\" span=\"\"></span> </p><p style=\"text-indent:22.0pt;\"><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\"></span></p><p style=\"text-indent:22.0pt;\"><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCYIA</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">常务副会长兼秘书长、大会组委会秘书长郑炜航透露：目前，包括皇家加勒比游轮集团、嘉年华邮轮集团、挪威邮轮集团在内的全球三大邮轮公司</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CEO</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">已经确认率团来华出席本届盛会，这是</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCS</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">举办</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">年来首次，可见国际邮轮巨头对中国市场的重视。</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">月</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">13</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">日晚开幕式上，有的将携新高管在</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCS10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">全球首次亮相，有的将在</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCS10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">全球首次宣布新战略，共同推动邮轮旅游度假这一时尚海上出游休闲方式。</span> </p><p style=\"text-indent:22.0pt;\"><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\"></span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\"></span></p><p><br/></p><p><br/></p>', '邮轮产业大会在上海举行'), ('48', '85', 'en', 'A taste of the Middle East of Arabia Bay', '<p class=\"ordinary-output target-output\"><span class=\"\">The mystery of the Middle East style, luxurious Arabia experience, become the new darling of cruise tourism.</span><span class=\"\"> Recently, 2014 Dubai commercial and Tourism Promotion Bureau, Arabia Bay Cruise China road show held in W Apartment Guangzhou.</span><span class=\"\"> Dubai, the Middle East region&#39;s leading cruise destination, to China to promote the cruise product is the first time.</span></p><p><br/></p>', 'Dubai new cruise'), ('50', '95', 'en', 'Three big cruise group global CEO for the first time gathered in CCS10', '<p class=\"ordinary-output target-output\"><span class=\"\">13-15\r\n day, the National Tourism Administration and the China Association of \r\ntransportation and transportation jointly organized by the China \r\nAssociation of transport of the cruise yacht club (CCS10) will be held \r\nin Hongkou, Shanghai.</span><span class=\"\"> The theme of this conference is the new fashion of cruise and marine life&quot;.</span><span class=\"\"> August the State Council promulgated the &quot;opinions on further \r\npromoting tourism investment and consumption&quot;, in the same period in the\r\n CCS10 special hosted the first national cruise tourism promotion, will \r\nhave a significant impact on the domestic and international tourism.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">The\r\n executive vice president and Secretary General of ccyia, congress \r\norganizing committee secretary zhenghuihang said: at present, including \r\nRoyal Caribbean Cruises group, Carnival cruises, Norwegian Cruise Line \r\nGroup, three of the world&#39;s largest cruise ship company CEO has \r\nconfirmed that led a delegation to China to attend this event, which is \r\n10 years for the first time, visible in the international cruise giant \r\nin the Chinese market value held in CCS.</span><span class=\"\"> October 13th evening opening ceremony, some will bring new executives\r\n in the CCS10 global debut, some will be the first to announce the new \r\nstrategy in the world of CCS10, jointly promote the cruise travel \r\nholiday fashion leisure fashion.</span></p><p><br/></p>', 'Cruise industry conference held in Shanghai'), ('52', '87', 'en', 'Sea Pageant', '<p class=\"ordinary-output target-output\"><span class=\"\">According to the cruise&#39;s net weight, length and capacity, for \r\neveryone to take stock of the world class super large cruise the top \r\nten, gorgeous extreme luxury.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Ocean\r\n liner was made in 2010, 2 inches (about 5 cm) longer than the Ocean \r\nOasis of the same company, becoming the world&#39;s largest cruise ship.</span><span class=\"\"> This cruise ship for a series of the world&#39;s largest cruise tukur shipyard in second ships.</span><span class=\"\"> The first is the oasis of the ocean, two cruise ships called sister ship.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Oasis\r\n of the seas cruise in November 2009 under the moon sea of maiden \r\nvoyage, when it in the sea, as it is a &quot;city of travel&quot;, 37 bars and 20 \r\nrestaurants.</span><span class=\"\"> Ocean Oasis on the cruise has an open square, on both sides of the room with a balcony.</span><span class=\"\"> The ocean oasis was at a cost of $3, more than 1 billion 400 million times bigger than the Titanic.</span></p><p><br/></p>', 'Meet the most luxurious cruise'), ('54', '89', 'en', 'Plus the longest 10 years of visa free interview to avoid leaving fingerprints', '<p>At the meeting, the Beijing News reporter get the opportunity to ask questions on the visa policy of the readers concerned and overseas travel convenience, measures to protect the interests of the Minister of foreign affairs Wang Yi. Beijing News reporter Chen Jie photo<br/><br/>Yesterday, foreign minister Wang Yi said that China and Canada on each issue valid for the longest period of 10 years to reach a consensus on the implementation of the 9. This is following the last November, Mita growing for many times visa reciprocity arrangements, and developed countries on visa facilitation and China reached a long-term mechanism arrangement.<br/><br/>9 from Canada issued a maximum of 10 years visa<br/><br/>It is reported that China and Canada agreed to each other since March 9, 2015 to each other&#39;s country to engage in business, tourism, visiting relatives and other citizens of the country issued a long-term visa. The visa is valid for up to 10 years as long as the passport is valid. This reciprocal arrangement is closely related to the good strategic partnership between the two countries.<br/><br/>In recent years, the two sides have frequent high-level exchanges and economic and trade cooperation has continued to expand the scale. 2013, in addition to nearly 1 million 200 thousand people exchanges, China and foreign students in nearly 100 thousand. Canada is the second largest country of destination of Chinese overseas investment, China is and the second largest trading partner and the second largest source of imports and the second largest export market, and the largest source of foreign students in China and overseas visitors fastest growing, the Chinese language has become the third largest language in Canada.<br/><br/>In this context, the two governments to comply with public opinion, to reach a mutually beneficial visa arrangements will further broaden the channels of exchanges between the two countries in various fields, to bring tangible benefits to the two peoples.<br/><br/>It is understood that, according to the principle of reciprocity and reciprocity, the two sides will also be related to the visa of the single, multiple visa fees uniform adjustment of 100 Canadian dollars and the corresponding rmb. Both sides of the visa application to provide free interviews and the convenience of fingerprints. Get a number of visas, it means that you can always pick up a passport, a walk on the trip to say.</p>', '  Tourism welfare'), ('56', '91', 'en', 'Sea Music Festival', '<p>With the window seawater slapping sound to wake up, a new day begins, the station in the deck breathe the sea air, blood, heart and lungs obtained a dialysis, at the moment, heart only the dark blue, like mermaid princess is sea of beautiful songs attract, experience a sea beautiful music feast!</p>', '  Music feast on the sea');
