INSERT INTO `vcos_common_problems_language` VALUES ('1', '91', 'zh_cn', '我会不会晕船', '<p>答：应该不会。邮轮的航线，都以当地的季节、气候、海象 等因素为重要考虑。除非遇上了恶劣的天候，海面上才有较 大的风浪，故大部份的航程，都是相当平稳的，甚至感觉不到邮轮在前进。<br/>豪华邮轮均配备高科技的平衡装置，能够减轻船体部份的晃动到最小，晕船的机率已大幅降低。</p>'), ('3', '189', 'zh_cn', '是否可以上网?', '<p>当然可以。您可以在自己的舱房或者一些公共区域连接到无线网络，使用支持无线网络的笔记本电脑，通过覆盖在邮轮上的无线网络上网。事先从网络服务供应商(ISP)订购网页版邮件服务的乘客，建议在上船前核实您的网页邮件查看功能。大部分ISP都有指定的网站，让您可以通过邮箱地址和密码直接在浏览器上查看邮件。关于网络收费要求及其它信息，请联系服务人员。</p>'), ('4', '191', 'zh_cn', '我生病了该怎么办?', '<p>请放心，船上有医务室及驻船医生，为您提供医疗救助及紧急状况的处理。如果状况非常紧急，我们会联络岸上的医疗队派遣直升机进行救援。以上产生的费用，需乘客自行承担。</p>'), ('17', '91', 'en', 'I will not be seasick?', '<p class=\"ordinary-output target-output\"><span class=\"\">Answer: should not be.</span><span class=\"\"> The cruise route in the local season, climate, and other factors to consider the walrus.</span><span class=\"\"> Unless it is in bad weather, the sea is only a big storm, so most of \r\nthe range, is quite smooth, and even feel the cruise in advance.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">A luxury cruise liner are equipped with high-tech balancing device, \r\ncan reduce the hull part of shaking to a minimum, the probability of \r\nseasickness has been significantly reduced.</span></p><p><br/></p>'), ('33', '223', 'zh_cn', '在邮轮上如何购物?如何付费?', '<p style=\"white-space: normal;\">邮轮上均使用无现金交易的房卡签账系统。消费时只要出示房卡即可，个别要求使用现金的场所例外，如外币兑换、以及娱乐场博彩。在航程的最后一晚， 邮轮将明细账单送到您的客房以供核对，并请至前台付清您的消费账目，如果您已经向天海邮轮提供了信用卡信息，并且开通了房卡自动还款功能，对邮轮\r\n所列清单上的项目没有异议，邮轮会自动根据账单向您的银行请款，您无需至前台付款。如果您对账单项目或退款有任何异议，请务必离船前联系前台工作人员\r\n解决。因为您下船后，邮轮公司恕不能受理有关消费清单的异议。 &nbsp; &nbsp;</p><p><br/></p>'), ('35', '225', 'zh_cn', '我一定要参加船上的活动吗?', '<p style=\"white-space: normal;\">除非是强制性的海上安全演习，邮轮上，您可以做您想做的事。或躺下不做任何事，那是您的假期。</p><p><br/></p>'), ('37', '227', 'zh_cn', '邮轮上的夜晚可以做什么?', '<p>在夜晚，船上的生活才正要开始。多样的丰富活动，像是舞蹈，夜总会现场表演，DISCO，酒吧，电影和新朋友的聚会。船上也有赌场，还有许多特别活动，例如船长鸡尾酒会，乘客的才艺表演，午夜自助餐。您想到玩到多晚都可以，甚至直到欣赏海上壮观的日出。</p>'), ('39', '229', 'zh_cn', '我可以携带多少重量的行李?', '<p>登船规定的行李最大重量为60公斤。此外也请谨记国际及国内班机对行李携带量的限制条件。 登船当天可在携带的行李上贴挂行李牌（在其上写明乘客的姓名、航次及所住客房的号码），船上工作人员会将行李送到指定客房。 &nbsp;</p>'), ('41', '231', 'zh_cn', '携带药品规定?', '<p>邮轮公司要求所有有特殊医疗需求的客人在旅行出发前提供自己的医疗信息。这是为了确保在发生紧急情况的时候能基于这些必要信息给予您适当的治疗和照顾。因医疗用途而携带注射器的旅客需要有医生证明。如需携带胰岛素注射器。 &nbsp; &nbsp;</p>'), ('43', '233', 'zh_cn', '我可否携带饮料和食物上船？ ', '<p>除酒精型饮料不得携带上船外，其它饮料及水皆可带上船。在船上购买的酒精型饮料需要先寄存在邮轮上，在邮轮旅行的最后一晚由船上的服务人员将其送回您的客\r\n房。您可携带干粮上船，如饼干，薯片，能量条等。 您也可以带上单独包装的沙拉，天海邮轮不接收，储存或烹饪游客自带的需烹饪食品。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('45', '235', 'zh_cn', '邮轮上的用餐情形如何?', '<p>邮轮船票包括免费餐厅的用餐。邮轮上设有固定的用餐时间，提供早餐，中餐，晚餐，以及24小时的点餐服务（收费项目）。用餐种类有特色自助餐，正宗西餐，您可以根据自己的需求自由选择。同时，除免费餐厅外，邮轮上还提供自费特色餐厅，您可以品尝世界各地的美食。 &nbsp;</p>'), ('47', '237', 'zh_cn', '船上的餐厅是24小时开放吗?', '<p>船上的餐厅很多，开放时间各不相同。一般用餐时间都会开放。另外船上有 24 小时的送餐服务（收费项目），保证您在任何时刻都可以享受到您想要的饮食。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('49', '239', 'zh_cn', '如果我有特殊餐食要求该如何做?', '<p>邮轮可以满足下列特殊饮食需求：素食主义者，糖尿病，低脂肪，低钠盐，低胆固醇饮食。除了主餐厅，其它餐厅不接受特殊餐饮安排要求。请在邮轮旅行开始\r\n前事先以书面形式提交您的饮食要求，并尽可能提供足够的详细信息。我们会努力满足合理的要求，但不保证能全部满足。上船后，请与餐厅领班联系，检查菜单，\r\n若有任何问题，敬请提出。 &nbsp; &nbsp;</p>'), ('51', '241', 'zh_cn', ' 船票都包含什么?上船后还有什么付费项目?', '<p>邮轮所列船票已经包括了所有的码头税和政府税。船票包含了船上膳食（不包括酒类、特饮及收费餐厅），您所预订的舱房住宿，所有公共设施使用和所有娱乐表演；不包括船上服务费，往返码头交通费，上岸观光团费用和私人消费（如理发，按摩，上网，电话，赌场筹码及商场购物等）。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('53', '243', 'zh_cn', '我如何知道在船上消费了多少金额?', '<p>在您下船的前一天，您会收到关于您信用卡消费的明细单，如果发现任何问题，请及时到客服柜台核实。你也可以随时到船上总服务台去进行询问。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('55', '245', 'zh_cn', '船上是按什么汇率进行兑换?', '<p>船上是按照当日交易汇率进行货币的兑换，一般来说，会略微高于国家对外公布的外币汇率。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('57', '247', 'zh_cn', '船上是否要支付服务费(小费)?', '<p>船上的服务费(小费)为船上现付的，显示在乘客本人的“船上消费账单”中，乘客需要在下船前将账单结清，并不是预先收取的。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br/></p><p>&nbsp;参考费用：内舱、海景、阳台等舱位每人12美金/晚，套房及以上舱位每人14美金/晚。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('59', '249', 'zh_cn', '什么是岸上观光?', '<p>在每一个靠岸点都有许多不同的岸上行程供旅客选择。您可根据自己的需要进行选择。所有岸上观光团的详细行程资料、价目并连同报名表将会在登船期间一并派\r\n发;旅客只需选择合适行程并填上有关数据交回岸上观光查询柜台，而观光团票将会集中所有数据后派发到房间;旅客可选择同时报名参加所有口岸的岸上观光团，\r\n或于每个口岸截止报名时间之前报名参加（截止时间请参考每日的节目表）。所有观光团在报名确认后将不能退款，请旅客细心选择行程。邮轮在每个口岸均会按指\r\n定时间关闸准备启航（所有时间为当地时间），请各旅客留意每天节目表及于舷梯出口刊登的时间。每位旅客必须携同其邮轮卡登岸。 &nbsp; &nbsp;</p>'), ('61', '251', 'zh_cn', '岸上观光会有导游吗?', '<p>大部分岸上观光是团进团出的，有大巴接送，还会配备中文地接。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('63', '253', 'zh_cn', '我必须通过邮轮预订我的岸上游行程吗?', '<p>预订岸上游的方法有两种: 一、通过天海官网提交预订单，大部分航线产品内提供岸上游行程供选择。二、通过您的邮轮代理或委托的旅行社预订咨询或者预订岸上游行程。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('67', '257', 'zh_cn', '那些东西不能带上船？', '<p>易燃易爆，有毒物品不能带上船上，枪支弹药也禁止带上船上<br/></p>'), ('68', '258', 'zh_cn', '会员卡丢失怎么办?', '<p>请不用担心，请马上来到邮轮前台来补办你会员卡，需出示你的身份证和房卡或者护照来重新补办你卡。谢谢<br/></p>'), ('70', '260', 'zh_cn', '房卡丢失怎么办?', '<p>什么，你既然丢失了房卡，你是想死了吗。请马上拿着你身份证号钱来前台补办，过期不候。谢谢<br/></p>'), ('72', '262', 'zh_cn', '护照丢了怎么办', '<p>没关系，你只是上不了船而已，没事的<br/></p>'), ('74', '189', 'en', 'Whether you can surf the Internet?', '<p class=\"ordinary-output target-output\"><span class=\"\">Certainly can.</span><span class=\"\">\r\n You can in my cabin or public areas connected to wireless networks, \r\nsupport the use of laptops with wireless network, covered by wireless \r\nnetwork on a cruise on the Internet.</span><span class=\"\">\r\n In advance from the network service provider (ISP) to order a web page \r\nversion of the mail service passengers, the proposal before the ship to \r\nverify your web mail view function.</span><span class=\"\"> Most ISP have a designated website, so you can check your email address and password directly on your browser.</span><span class=\"\"> For network fees and other information, please contact the service staff.</span></p><p><br/></p>'), ('76', '229', 'en', 'How much luggage can I carry?', '<p class=\"ordinary-output target-output\">Boarding luggage is 60 kilograms of provisions.<span class=\"\"> In addition, please bear in mind that international and domestic flights are limited to the amount of baggage carried.</span><span class=\"\">\r\n Embarked on the same day in carry on luggage put up luggage tag (stated\r\n on the passenger&#39;s name, voyage and the room number), the crew will \r\nluggage will be sent to the designated rooms.</span></p><p><br/></p>'), ('78', '231', 'en', 'Regulations for carrying drugs?', '<p class=\"ordinary-output target-output\"><span class=\"\">Cruise lines require all guests with special medical needs to provide their own medical information before traveling.</span><span class=\"\"> This is to ensure that you can give you the appropriate treatment and care for the event of an emergency.</span><span class=\"\"> A passenger who carries a syringe for medical purposes requires a doctor&#39;s certificate.</span> To carry insulin syringes.</p><p><br/></p>'), ('80', '191', 'en', 'What should I do with my illness?', '<p class=\"ordinary-output target-output clearfix\"><span class=\"\">Please &nbsp;rest assured that there is a medical room and a doctor on board, to &nbsp;provide you with medical assistance and emergency treatment.</span><span class=\"\"> If the situation is very urgent, we will contact the medical team on the shore to send a helicopter to rescue.</span><span class=\"\"> The cost of the above, the need for passengers to bear.</span> </p><p><br/></p>'), ('82', '223', 'en', 'How to do shopping on a cruise ship? How to pay?', '<p>The use of non cash transactions on the cruise of the real card account system. As long as the consumption of the room card can be produced, the individual requirements of the use of cash in place exceptions, such as foreign currency exchange, as well as the casino gaming. Last night in the voyage of the cruise will itemized bills sent to your room for verification, and please to the front desk to pay your consumer accounts, if you have Tianhai cruise to provide credit card information, and the opening of the real card automatic repayment feature and the ship listed items on the list has no objection to the cruise will automatically according to the account check your bank payment request, you do not need to pay downstage. If you have any objection to the bill items or refund, please be sure to contact the front desk staff before the ship. Because you disembark after the cruise company cannot accept the relevant consumption list of objections.<br/></p>'), ('84', '225', 'en', '  Do I have to take part in the activities on the ship?', '<p>You can do what you want to do, unless it is mandatory for maritime safety drills. Or lie down and don&#39;t do anything that is your holiday.</p>'), ('86', '227', 'en', 'What can be done on a cruise on the night?', '<p class=\"ordinary-output target-output clearfix\">In the night, the ship&#39;s life is just about to start.<span class=\"\"> A variety of activities, such as dancing, night clubs, live shows, DISCO, bars, movies, and new friends.</span><span class=\"\"> There are also many special events, such as the captain&#39;s cocktail party, the talent show, the midnight buffet.</span><span class=\"\"> You can play until you can, and even enjoy the spectacular sunrise at sea.</span> </p><p><br/></p>'), ('88', '235', 'en', 'How about a meal on a cruise ship?', '<p>The dining cruise includes free restaurant. The cruise is provided with a fixed time of meal, breakfast, lunch, dinner, and 24 hours of service (fee item). Have a distinctive style buffet, authentic western style food, you can choose according to their own needs. At the same time, in addition to the free restaurant, the cruise also offers a special restaurant at their own expense, you can enjoy the food around the world.</p>'), ('90', '237', 'en', '  Is the restaurant open for 24 hours?', '<p class=\"ordinary-output target-output clearfix\">The restaurant on board a lot of open time is not the same.<span class=\"\"> General dining hours will be open.</span><span class=\"\"> Also on board, there are 24 hour room service (Fees) to ensure you at any time can enjoy the food you want.</span> </p><p><br/></p>'), ('92', '239', 'en', '  If I have a special meal for how to do?', '<p>Cruise can meet the following special dietary needs: vegetarians, diabetes, low fat, low sodium, low cholesterol diet. In addition to the main dining room, other restaurants do not accept special catering arrangements. Please in the cruise starts in written form to submit your dietary requirements as far as possible to provide sufficient detail. We will try to meet the reasonable requirements, but we can not guarantee that we can fully meet the requirements. After the ship, please contact the restaurant captain, check the menu, if there is any problem, please put forward.</p>'), ('94', '249', 'en', 'What is the shore sightseeing?', '<p>At every point in a number of different shore travel for passengers to choose. You can choose according to their own needs. All shore tour detailed itinerary information, price and together with the registration form will be boarding during together sent hair; passengers only need to choose the proper stroke and fill in the relevant data to pay back to shore excursions inquiry counters, and tour tickets will focus on all the data distributed to the room; passengers can choose at the same time, register for all port shore excursions group, or to each port before registration time deadline enrolled in (deadline please reference daily program schedule). All tours in the registration confirmation will not be refunded, please carefully select the itinerary. Cruise in each of the port will be to set the time gate ready to sail (all the time for local time), please passengers pay attention to daily program schedule and exit ramp and published in time. Each passenger must present its cruise landing card.</p>'), ('96', '251', 'en', 'Do you have a tour guide on the shore?', '<p class=\"ordinary-output target-output clearfix\"><span class=\"\">Most of the shore sightseeing tour is a mission out of the group, there is a bus transfer, will be equipped with Chinese ground.</span> </p><p><br/></p>'), ('98', '253', 'en', 'Do I have to book my coast on a cruise?', '<p class=\"ordinary-output target-output clearfix\"><span class=\"\">Reservation &nbsp;bank upstream method has two: one, through the official website of &nbsp;Tianhai submit pre orders. Most routes within the product provide bank &nbsp;upstream travel choice.</span><span class=\"\"> Two, through your cruise agent or commissioned by the travel agent booking advice or booking the upper reaches of the coast.</span> </p><p><br/></p>'), ('100', '241', 'en', 'What are the tickets? What are the payment items after the ship?', '<p>The cruise ticket has included all terminal tax and government tax. Ticket price includes the ship diet (not including alcohol, special drink and restaurant charges), your reservation cabin accommodation, all use of public facilities and all entertainment; it does not include ship service fee, round-trip transportation to the terminal fee, ashore tour fees and private consumption (such as hair, massage, Internet, telephone, casino chips and shopping malls, etc.).</p>'), ('102', '243', 'en', 'How do I know how much money is spent on the ship?', '<p>The day before your boat, you will receive on your credit card consumption list, if there is any problem, please promptly to the customer service counter to verify. You can also go to the ship at any time to the general service desk to ask.</p>'), ('104', '245', 'en', 'What is the exchange rate on board?', '<p class=\"ordinary-output target-output clearfix\"><span class=\"\">On &nbsp;board the exchange rate of exchange for the day is in accordance with &nbsp;the exchange rate, in general, will be slightly higher than the state&#39;s &nbsp;foreign exchange rate of foreign exchange.</span> </p><p><br/></p>'), ('106', '247', 'en', '  Do you want to pay the service fee on board (tip)?', '<p class=\"ordinary-output target-output clearfix\"><span class=\"\">Ship service fee (tip) for cash on board, display in the passenger &nbsp;himself &quot;on board bills&quot;, passengers need before you get off the ship &nbsp;will settle his bill, and not a pre charge.</span> </p><p class=\"ordinary-output target-output clearfix\"><span class=\"\">Reference cost: cabin, sea view, balcony space for $12 per person / night, suites and over $14 per person / night accommodation.</span> </p><p><br/></p>');
COMMIT;

-- ----------------------------
--  Table structure for `vcos_country`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_country`;
CREATE TABLE `vcos_country` (
  `country_id` int(11) NOT NULL AUTO_INCREMENT,
  `country_code` varchar(32) DEFAULT NULL,
  `country_number` varchar(32) DEFAULT NULL COMMENT '数字代号',
  `country_name` varchar(128) DEFAULT NULL,
  `country_name_en` varchar(128) DEFAULT NULL,
  `country_short_code` char(3) DEFAULT NULL COMMENT '3 Character',
  `country_state` int(1) DEFAULT '0' COMMENT '状态 0可用',
  `mark` varchar(128) DEFAULT NULL,
  `create_by` varchar(32) DEFAULT NULL,
  `create_time` int(11) DEFAULT '0',
  PRIMARY KEY (`country_id`),
  KEY `country_code` (`country_short_code`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=496 DEFAULT CHARSET=utf8 COMMENT='国家表';

-- ----------------------------
--  Records of `vcos_country`
