INSERT INTO `vcos_cruise_info_language` VALUES ('35', '31', 'zh_cn', '<p>“中华泰山”邮轮隶属于中国首家国际邮轮公司——渤海邮轮有限公司，该公司成立于2014年2月，是渤海轮渡股份有限公司全资子公司，总部设在香港。邮轮公司注册地在香港，邮轮悬挂巴拿马旗。中华泰山号邮轮是我国第一艘全资、自主经营管理的豪华邮轮,该邮轮于今年3月底从意大利启航,5月初到达国内,后更名为“中华泰山”号。</p>'), ('37', '33', 'zh_cn', '<p>船内各种配套设施非常完善，剧院、画廊、图书馆、网吧、钢琴吧、迪斯科舞厅娱乐场、游泳池、水疗按摩+桑拿、宴会厅、各式餐厅、酒吧俱乐部、多功能会议室 、棋牌室、儿童护幼中心、免税店、健身房、娱乐会所、小教堂等一应俱全，可以满足船上乘客各项生活和娱乐需求。</p>'), ('39', '35', 'zh_cn', '<p>满载排水量：2.45万吨&nbsp;&nbsp; 平均航速：22节<br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 甲板楼层：7层&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客房数量: 416间<br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 船长：180.45米&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 船宽：25.5米<br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 最高航行速度: 28节&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; 载客量：927人</p>'), ('45', '41', 'zh_cn', '<p>船内各种配套设施非常完善，剧院、画廊、图书馆、网吧、钢琴吧、迪斯科舞厅、娱乐场、游泳池、水疗按摩+桑拿、宴会厅、各式餐厅、酒吧俱乐部、多功能会议室、棋牌室、儿童护幼中心、免税店、健身房、娱乐会所、小教堂等一应俱全，可以满足船上乘客各项生活和娱乐需求.</p>'), ('47', '41', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Ships\r\n of all kinds of supporting facilities are perfect, theatres, galleries,\r\n libraries, Internet cafes, piano cafes, discos, casinos, swimming pool,\r\n spa massage and sauna, banquet hall, restaurants, bars and clubs, \r\nmulti-purpose conference room, chess room, child support young center, \r\nduty-free shops, gym, entertainment clubs, chapels and other facilities,\r\n it can be meet the ship passengers the living and entertainment needs.</span></p><p><br/></p><p><br/></p><p><br/></p>'), ('49', '43', 'zh_cn', '<p>歌诗达邮轮（Costa Cruise Lines）曾经是世界上最大的邮轮，起源于1860年的Costa家族，名字源自始创人贾西莫。歌诗达先生（Giacomo Costa），有着悠久而辉煌的历史。以“意大利风情（Cruising Italian Style）为品牌定位的意大利歌诗达邮轮公司是欧洲地区最大的邮轮公司。<br/>歌诗达的豪华邮轮无论是外观还是内部装潢，都弥漫着一股意大利式的浪漫气息，尤其在蔚蓝的欧洲海域，歌诗达船队以艳黄明亮色调的烟囱，搭配象征企业识别标志的英文字母C，航行所到之处均是掀起人们惊艳的目光，成为欧洲海域最为璀璨耀眼的船队！之所以选择歌诗达品牌率先进入中国市场，是因为该品牌为嘉年华旗下12个邮轮品牌中最国际化的一个。在进入中国之前，歌诗达邮轮的足迹遍布除亚洲以外的几乎任何一个地区，而如今来到中国，可以称得上是填补了全球版图上的最后一块空白.<br/></p>'), ('50', '44', 'zh_cn', '<p>皇家加勒比邮轮体验全舱“海景”时代，坐拥智能科技舱房，精心的设计与装潢。科技与创意的结合，惊险与乐趣的共融，领略“舌尖上的量子号　</p>'), ('52', '44', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Royal\r\n Caribbean cruise experience the whole cabin &quot;harbour&quot; era, with \r\nintelligent technology to design and decorate the cabin, carefully.</span><span class=\"\">\r\n The combination of science and technology and creativity, the \r\ncombination of adventure and fun, a taste of the quantum of the tongue.</span></p><p><br/></p>'), ('54', '43', 'en', '<p>Costa cruise lines used to be the world&#39;s largest cruise ship, originated in 1860 the Costa family. The name comes from the founder Jaszi mo. Mr. Costa (Giacomo Costa), has a long and glorious history. The cruising Italian style for the brand positioning of the Italian Company Costa cruises is Europe&#39;s largest cruise company.<br/><br/>The luxury cruise ship Costa both appearance and interior, are filled with a stream of Italian romantic atmosphere, especially in European sea blue, Costa fleet with bright yellow color of the chimney, a symbol of corporate identity logo with letter C, navigate to the are off it &#39;s amazing eyes, off the coast of Europe to become the most dazzling fleet! Chose Costa brand took the lead to enter the Chinese market, because the brand is the most international of Carnival&#39;s 12 cruise brands in a. Before entering China, Costa Crociere footprint in Asia in addition to almost any area, and now came to China, can be called to fill the last piece of blank map of the world.</p>'), ('56', '35', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Full load displacement: an average speed of 22 knots</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Deck floor: 7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; rooms: 416</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Captain: 180.45 meters&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; width: 25.5 meters</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Maximum cruising speed: 28 quarter&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; capacity: 927</span></p><p><br/></p>'), ('58', '33', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Ships\r\n of all kinds of supporting facilities are perfect, theatres, galleries,\r\n libraries, Internet cafes, piano, disco entertainment field, swimming \r\npool, spa massage and sauna, banquet hall, restaurants, bars and clubs, \r\nmulti-purpose conference room, chess room, child support a child care \r\ncenter, free tax shop, gym, entertainment clubs, Chapel and other \r\nfacilities, can meet the ship passengers the living and entertainment \r\nneeds.</span></p><p><br/></p>'), ('60', '31', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">China &nbsp;Taishan cruise subordinate to belong to China&#39;s first international &nbsp;cruise company -- Bohai sea cruises Co., Ltd., the company was &nbsp;established in February 2014, the Bohai Sea Ferry Co., Ltd is a &nbsp;wholly-owned subsidiary, headquartered in Hong Kong.</span><span class=\"\"> Cruise company registered in Hongkong, Panama, the cruise ship.</span> &nbsp;Taishan, China&#39;s first cruise ship is a wholly owned, independent &nbsp;management of luxury cruise ships, the cruise from Italy in the end of 3 &nbsp;this year, from to reach the country, after the name of the &quot;China &nbsp;Taishan&quot;.</p><p><br/></p>');
COMMIT;

