-- ----------------------------
--  Table structure for `vcos_goods_order`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_goods_order`;
CREATE TABLE `vcos_goods_order` (
  `order_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_serial_num` varchar(32) DEFAULT NULL COMMENT '订单号',
  `membership_id` int(11) DEFAULT NULL,
  `totale_price` int(11) DEFAULT NULL,
  `pay_type` tinyint(4) DEFAULT NULL COMMENT '支付类型(1余额，2挂账，3到付)',
  `order_check_num` varchar(32) DEFAULT NULL COMMENT '订单校验码',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `order_create_time` datetime DEFAULT NULL COMMENT '订单创建时间',
  `order_state` tinyint(4) DEFAULT NULL COMMENT '订单类型',
  `order_remark` varchar(100) DEFAULT NULL,
  `is_read` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
