-- ----------------------------
--  Table structure for `vcos_lifeservice_language`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_lifeservice_language`;
CREATE TABLE `vcos_lifeservice_language` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ls_id` int(10) unsigned NOT NULL,
  `iso` varchar(60) NOT NULL,
  `ls_title` varchar(255) NOT NULL,
  `ls_desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `ls_info` text NOT NULL,
  `ls_address` varchar(255) NOT NULL,
  `ls_opening_time` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `lsid&iso` (`ls_id`,`iso`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=118 DEFAULT CHARSET=utf8 COMMENT='休闲服务语言表';

