INSERT INTO `vcos_lifeservice_language` VALUES ('21', '63', 'zh_cn', '水疗', '是利用不同温度、压力和溶质含量的水， 以不同方式作用于人体以防病治病的方法，是放松身心的好去处。', '<p><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Arial, 宋体; font-size: 15px; line-height: 25px; text-indent: 32px;\">&nbsp; 特别加入草本精油，能散发怡人香熏。其中熏衣草精油可舒缓压力、放松心情；而柠檬精油让您的肌肤更显光滑娇嫩。</span></p>', '第五层甲板', '9：00-14：00'), ('23', '65', 'zh_cn', '海语贵宾室', ' 贵宾室能够将一些细节做到极致，比如你可以在这里沉睡很久然后还有米其林级别的厨师给你准备美食', '<p><span style=\"font-family: Arial; font-size: medium; color: rgb(51, 51, 51); line-height: 26px; text-indent: 28px;\">&nbsp; 贵宾室能够将一些细节做到极致，比如你可以在这里沉睡很久然后还有米其林级别的厨师给你准备美食！</span></p>', '第七层甲板', '9：00-14：00'), ('25', '67', 'zh_cn', '欢畅音乐', '各类小吃、餐饮、酒水上千种，轩尼诗XO等各类名酒种类齐全，七彩绚丽的灯光影耀下，K歌与品酒文化完美结合、相应成趣', '<p><span style=\"line-height: 1.5;\"><span style=\"font-family:Arial;font-size:16px\">&nbsp; 尽情欢畅！！</span></span></p>', '第六层甲板', '19：00-23：00'), ('27', '69', 'zh_cn', '情湾酒吧', '  营造出艺术与自由、华丽和颓废的醇和新感受，革新一个时代的夜生活体验', '<p>灯光虽耀眼，却没有那般喧闹；音乐虽劲爆，却是如瀑布般让人畅爽；红酒虽妖媚，却是那般的诱人。温和的服务生、帅气的调酒师成了这里最美的点缀。</p>', '第五层甲板', '16：00-24：00'), ('29', '71', 'zh_cn', '芳香按摩', '将植物芳香精油运用“香熏”、“按摩”和“沐浴”等的方法，从而对人在生理和心理上进行调整', '<p><span style=\"font-family: Arial; font-size: medium; color: rgb(51, 51, 51); line-height: 24px;\">&nbsp; 到达神经系统，以帮助人体身心获得缓解，并达到保养皮肤，改善身体健康的功效。</span></p>', '第六层甲板', '9：00-24：00'), ('31', '73', 'zh_cn', '年轻一起唱', '触摸屏点歌系统，一流的音响效果，在这里您的演唱水平堪比专业歌手级别，歌声无懈可击。', '<p><span style=\"font-family:Arial;font-size:16px\"><span style=\"font-size: medium; line-height: 21.6667px;\">&nbsp; 想唱就唱，我最闪亮。</span></span><br/></p>', '第五层甲板', '24小时'), ('33', '75', 'zh_cn', '唱唱KTV', '专业级的演唱效果，带给您明星般的待遇和体验以及激情洋溢的舞台氛围，让您的身心充分感受快乐，彰显时尚和尊贵套顶级进口音响，超低音音箱', '<p><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">&nbsp; 全天24小时营业，包房以计时钟消费，没最低消费，酒水食品以量贩自助式购买。</span></p>', '第五层甲板', '24小时'), ('35', '77', 'zh_cn', '开心时刻', '开心的时候要唱歌，不开心的时候更要唱歌。小房300，中房400，大房500，房间干净，环境好。', '<p>开心每一时刻<br/></p>', '第五层甲板', '24小时'), ('37', '79', 'zh_cn', '来聚酒吧', '是一家以时尚音乐加人性化的精致服务为一体的大型跨省直营娱乐品牌酒吧', '<p>这里有灯红酒绿，各形各色的人汇聚，来自五湖四海，有缘就会相聚。</p>', '第七层甲板', '19：00-24：00'), ('39', '81', 'zh_cn', '脸部护理', '对脸部进行按摩、护理、美白保湿，女人的天堂，每天都会美美的。', '<p>去斑，平纹，除糙，肌肤，老化等产生的机理及生理特点一站式解决，通过仪器治疗，皮肤护理，中医内调，解决各种皮肤深层问题。</p>', '第六层甲板', '24小时'), ('41', '83', 'zh_cn', '最美的时光', '最美时光留住记，  娱乐场观看精彩的表演，活跃的气氛嗨全场。', '<p>以提供高质量的娱乐平台为宗旨，给予个层级会员尊荣高安全性的服务。少数国内拥有世界级认证的在线娱乐公司，能称为国际专业的网上娱乐平台营运商，根据调查金赞在线娱乐拥有同业中最多国际级的财务学者</p>', '第七层甲板', '17：00-23：00'), ('43', '85', 'zh_cn', '大剧场', '在这里可以观赏歌剧、音乐剧、芭蕾、交响乐、室内乐、话剧、戏曲等各类大型演出和综艺晚会。', '<p><span style=\"line-height: 1.5;\"><span style=\"font-family:Arial;font-size:16px\">&nbsp;我剧场每年需举办45—50场大型文艺演出，涉及演出费用4500万元，演出内容包括综艺、演</span></span>唱会、戏曲、杂技、歌舞等所有文艺类型</p><p><span style=\"line-height: 1.5;\"><span style=\"font-family:Arial;font-size:16px\"></span></span><br/></p>', '第六层甲板', '10：00-12：00'), ('45', '87', 'zh_cn', '挪威森林', '   酒在绽放之中,滑入喉咙,清甜过后是浓郁的辣.跃动的人们踩着那旋律,各自舞动着自己独特的舞步', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp;&nbsp; 是一家音乐休闲吧。环境幽雅,装修风格独特。是一所真正意义上的<em>森林酒吧</em>。一楼为酒吧,外设露天演出台和休闲娱乐区,朋友们可以边喝边聊边看演出</span></p>', '第七层甲板', '19：00-22：00'), ('47', '89', 'zh_cn', '海力酒吧', '摇滚时代', '<p><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">&nbsp; 海力酒吧</span><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">歌手们则已然带动起了人们的热情,用沙哑的摇滚,创造一个音乐的时代。</span></p>', '第六层甲板', '19：00-23：00'), ('49', '91', 'zh_cn', 'Lose Demon吧', '情调慢慢涨', '<p><span style=\"color: rgb(51, 51, 51); font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: auto; text-align: left; text-indent: 28px; text-transform: none; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; float: none; display: inline !important; background-color: rgb(255, 255, 255);\"><span style=\"font-family:Arial;font-size:16px\">将细节做到极致，满意为止！</span></span></p>', '第七层甲板', '19：00-24：00'), ('51', '93', 'zh_cn', '娱乐演出', '这里有话剧、歌舞、魔术等等，您可以看到非常的精彩的演出，别人的世界自己的感觉', '<p><span style=\"text-align: justify;\"><span style=\"font-family:Arial;font-size:16px\"><span style=\"line-height: 26.6666679382324px;\">&nbsp;周杰伦 中国台湾华语流行歌手、著名音乐人、音乐创作家、作曲家、作词人、制作人、 杰威尔音乐公司老板之一、导演。周杰伦是 2000 年后亚洲流行乐坛最具革命性 与指标性的创作歌手，亚洲销量超过 2700 万张，有“亚洲流行天王”之称</span></span></span></p>', '第五层甲板', '24小时'), ('53', '95', 'zh_cn', '碰碰车', '您可以带着你的小孩来体验碰撞的快乐，让您们的亲情更近一步，是陪孩子玩乐的好场所', '<p>碰碰车是一种机动游戏设施。设备包括碰碰车车辆及一个室内的场地。天花板上有通电的电网。场内有供乘客驾驶的小型电动碰碰车。碰碰车的四周有由橡胶做成的围裙，并由接到天花板的垂直电杆取电。车上一般最多坐二人，有加速用的脚踏，和转向的方向盘。</p>', '第五层甲板', '24小时'), ('55', '97', 'zh_cn', '花样溜冰', '小孩、大人都可以来玩，在这里感觉溜冰的快乐与激情，让我们溜起来', '<p>始于20世纪30年代的英国。偏重舞步，强调用动作表达音乐。1937年英国举办首届冰上舞蹈锦标赛，1949年起被列为单独比赛项目。由一男一女配对参赛。<br/><br/><br/></p>', '第七层甲板', '24小时'), ('57', '99', 'zh_cn', '淋巴排毒', '主要是通过按摩师进行专业的按摩全身的部位，来排除身体的毒', '<p>由于脸部的淋巴位于发际线、耳后、下巴的脸部外围，且就在皮肤底下，所以按摩力道以轻柔为主，以下是目前我们找到最简易的手法，利用地心引力及5个步骤，就能达到淋巴引流的目的。<br/><br/><br/></p>', '第六层甲板', '24小时'), ('59', '101', 'zh_cn', '精油疗法', ' 添加自然中药配方，精油疗法后瞬间醒神，达到一个循环气血和美容养颜的效果，对女性有着独特的吸引力。', '<p><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">这是一种利用植物精油，来刺激人体穴道，充分吸收之后，达到一个循环气血和美容养颜的效果，对女性有着独特的吸引力。精油是可以由顾客自行选择，然后经过专业的按摩师按摩。</span></p>', '第七层甲板', '24小时'), ('61', '103', 'zh_cn', '香薰', '常用香薰油泡浴、按摩，再配上轻柔的音乐，鼻间嗅入清新甜美的花香， 沁入骨髓，暗香浮动，令您拥有迷人和浪漫的气质。', '<p>使身心恢复协调，消除忧郁、焦虑、烦闷、愤怒等情绪和疲劳感，来达到一种身、心、灵皆俱舒畅的感觉。</p>', '第六层甲板', '24小时'), ('63', '105', 'zh_cn', '宾丽KTV', '购买酒水小吃600以上，K房免费，预定唱满5个小时以上的，送水果拼盘一盘酒', '<p>量贩式KTV的特点：量贩式KTV娱乐场所，也就是夜场其中之一，于上世纪90年代初自日本、台湾地区流入中国大陆，主要以白领一族、家庭聚会、公司party为消费群体<br/></p>', '第六层甲板', '10：00-22：00'), ('65', '107', 'zh_cn', '明珠娱乐KTV', '和亲朋好友一起高歌和海浪一起欢唱，来吧，释放你压力与烦恼', '<p><span style=\"font-family: Arial; font-size: medium; line-height: 21.6666679382324px;\"></span><span style=\"font-family: 宋体\">我司一直秉承</span><span style=\"font-family: Verdana\">&quot;</span><span style=\"font-family: 宋体\">让全城欢乐起来</span><span style=\"font-family: Verdana\">&quot;</span><span style=\"font-family: 宋体\">的理念，始终坚持以顾客的需求和满意为核心。为给顾客提供休闲舒适的娱乐环境。各个包厢均配备进口高清</span><span style=\"font-family: Arial\">PDP</span><span style=\"font-family: 宋体\">电视机及专业舒