INSERT INTO `vcos_line_detail_language` VALUES ('1', '1', 'zh_cn', '第二天', '<p>釜山是韩国面积最大且人口密集度排名第二的港口城市。釜山所处的地理位置优越。除是一个天然良港以外，在其海岸线上还有很好的沙滩和美丽的海滨风景；</p>', null), ('2', '3', 'zh_cn', '第三天', '<p>今天迎来全天的邮轮海上巡游，让轻松舒适来开启您的邮轮之旅。您可以根据自己的喜好，享受船上的休闲娱乐设施及各式美食,体验丰富多彩的娱乐项目,参加特色的船上课程。</p>', null), ('3', '3', 'en', 'second day123123123123', '<p>eat banana<br/></p>', null), ('4', '1', 'en', 'first day', '<p>eat curry rice<br/></p>', null), ('17', '11', 'zh_cn', '第四天', '<p>迎着微微海风的吹拂，您将抵达终点港口。您可以凭海临风，看着邮轮缓缓驶入码头——结束这一难忘的假期。</p>', null), ('19', '11', 'en', 'kanshijie', '<p>shijienameda</p>', null), ('21', '13', 'zh_cn', '第四天', '<p>迎着微微海风的吹拂，您将抵达终点港口。您可以凭海临风，看着邮轮缓缓驶入码头——结束这一难忘的假期。</p><p><br/></p>', null), ('23', '13', 'en', 'LOOK', '<p>LookLook<br/></p>', null), ('25', '15', 'zh_cn', '第一天', '<p>登船 请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅。</p>', null), ('27', '17', 'zh_cn', '第三天', '<p>巴特罗之家如果不是亲眼所以见，真的不敢相信这个世界上还有这样的建筑，令人惊艳。我只能告诉大家建筑本身就是件精湛...</p>', null), ('29', '19', 'zh_cn', '第二天', '<p>圣家族大教堂非常另类的大教堂，外形酷似魔窟，但走进去才会发现这里仍然保留了传统教堂的功能，但装饰更为前卫、另类，.<br/></p>', null), ('31', '21', 'zh_cn', '第一天', '<p>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！</p>', null), ('33', '23', 'zh_cn', '第四天', '<p>迎着微微海风的吹拂，您将抵达终点港口。您可以凭海临风，看着邮轮缓缓驶入码头——结束这一难忘的假期。</p>', null), ('35', '25', 'zh_cn', '第三天', '<p>珍南海滩的白天和夜晚都深深吸引我们，白天的湛蓝清澈，夜晚的安静幽美让人流连忘返，下次去兰卡威还是首选...</p>', null), ('37', '27', 'zh_cn', '第二天', '<p>兰卡威（Langkawi）可以算得上是东南亚最令人向往的风景胜地。清澈碧绿的海水和绵长平缓的沙滩构成了天堂般的海滨度假地，葱郁繁茂的森林与神秘而壮观的岩洞是独具魅力的探险地。&nbsp;&nbsp; <br/></p>', null), ('39', '29', 'zh_cn', '第一天', '<p>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！</p>', 'line_images/201605/201605180945473847.png'), ('43', '33', 'zh_cn', '第四天', '<p>今天迎来全天的邮轮海上巡游，让轻松舒适来开启您的邮轮之旅。您可以根据自己的喜好，享受船上的休闲娱乐设施及各式美食,体验丰富多彩的娱乐项目,参加特色的船上课程。</p>', 'line_images/201510/201510121039415038.jpg'), ('45', '35', 'zh_cn', '第三天', '<p>【原子弹爆炸纪念馆】馆内展示当时原爆的原始图片和文字资料，以及当今世界各国的核武器试验状况，提醒我们要时刻维护世界和平。</p>', 'line_images/201510/201510121038594543.jpg'), ('47', '37', 'zh_cn', '第二天', '<p>【长崎中华街】新地中华街与横滨、神户的中国式街道并列为日本三大中华街。</p>', 'line_images/201510/201510121038286375.jpg'), ('49', '39', 'zh_cn', '第一天', '<p>&nbsp;&nbsp;&nbsp;&nbsp; 登船 请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅。</p>', 'line_images/201510/201510121037346136.jpg'), ('51', '41', 'zh_cn', '第四天', '<p>迎着微微海风的吹拂，您将抵达终点港口。您可以凭海临风，看着邮轮缓缓驶入码头——结束这一难忘的假期。</p>', 'line_images/201510/201510121044322675.jpg'), ('53', '43', 'zh_cn', '第三天', '<p>【南怡岛】（约2小时）因韩剧《冬季恋歌》而蜚声全亚洲，剧中男女主人公俊相和有真就曾幸福地在小岛的四处徜徉。 <br/></p>', 'line_images/201510/201510121044121733.jpg'), ('55', '45', 'zh_cn', '第二天', '<p>【N首尔塔外观+爱情锁墙】首尔塔（不含登塔费用）及爱情锁墙为【来自星星的你】千颂伊与教授锁住爱情的地方。</p>', 'line_images/201510/201510121043514794.jpg'), ('57', '47', 'zh_cn', '第一天', '<p>登船<br/>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！</p>', 'line_images/201510/201510121043118678.jpg'), ('61', '51', 'zh_cn', '第三天', '<p>【博多运河城】博多运河城是福冈乃至九州最热闹的一个购物娱乐中心。自由活动。</p>', 'line_images/201510/201510111849316129.jpg'), ('63', '53', 'zh_cn', '第二天', '<p>【龙头岩】汉拿山喷出的熔岩堆积而成的奇岩绝景，龙升天形状的奇石，济州观光的象征。</p>', 'line_images/201510/201510111849211906.jpg'), ('65', '55', 'zh_cn', '第一天', '<p>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！</p><p><br/></p>', 'line_images/201510/201510111849058155.jpg'), ('71', '55', 'en', 'one_day', '<p>good<br/></p><p><img src=\"/ueditor/php/upload/image/20151012/1444642638642077.jpg\" style=\"\" title=\"1444642638642077.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20151012/1444642639115045.jpg\" style=\"\" title=\"1444642639115045.jpg\"/></p><p><br/></p>', 'cruiseinfo_images/201510/201510121038038371.jpg'), ('77', '63', 'zh_cn', '第一天', '<p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">请您前往港口，办理邮轮登船手续，登上邮轮，开</span><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">始您浪漫精彩的邮轮之旅<span style=\"font-family: 黑体, SimHei;\"></span>！</span></p>', 'line_images/201510/201510131014023599.jpg'), ('81', '69', 'zh_cn', '第一天', '<p>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！<br/></p>', 'line_images/201510/201510191132173151.jpg'), ('82', '69', 'en', 'first day', '<p><span style=\"color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, &#