-- ----------------------------
--  Table structure for `vcos_member_booking`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_member_booking`;
CREATE TABLE `vcos_member_booking` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `booking_no` varchar(32) DEFAULT NULL,
  `member_code` varchar(32) DEFAULT NULL,
  `booking_name` varchar(255) DEFAULT NULL,
  `booking_time` datetime DEFAULT NULL,
  `booking_num` int(11) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1预定中，2预定成功，3预订失败，已过期，4.完成服务，5.取消预约，6.删除预约',
  `store_id` varchar(255) DEFAULT NULL COMMENT '餐厅或休闲店铺id',
  `booking_type` tinyint(4) DEFAULT NULL COMMENT '1餐厅,2休闲服务',
  `create_time` datetime DEFAULT NULL,
  `is_read` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0未读，1已读',
  `remark` varchar(255) DEFAULT NULL,
  `booking_sign` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=utf8;

