INSERT INTO `vcos_notice_to_visitors_language` VALUES ('3', '3', 'zh_cn', 'safe_images/201510/201510081656017052.jpg', '<p>出席正式晚宴，女士必须穿著晚礼服，男士则必须以西装、领带或燕尾服打扮!</p>'), ('5', '3', 'en', 'safe_images/201601/201601181347239981.jpg', '<p>To attend a formal dinner, she must wear evening dress, men have to suit, tie or tuxedo dress!</p>'), ('7', '5', 'zh_cn', 'safe_images/201510/201510081659328694.jpg', '<p>无论是室内或室外，日间穿着以短裤、T恤、西裤、休闲裙、衬衫及夏日洋装装扮，最为合适！</p>'), ('9', '5', 'en', 'safe_images/201601/201601181348025851.jpg', '<p>Whether indoor or outdoor, day wearing shorts, T-shirt, trousers, casual dress, shirts and dresses！</p>'), ('11', '7', 'zh_cn', 'safe_images/201510/201510081653343417.jpg', '<p>房间里是220V美标和欧标两种电源插座，浴室的插座是110V -220V的，别忘记带转换插头。。</p>'), ('15', '15', 'zh_cn', 'safe_images/201510/201510081709446735.jpg', '<p>我们也提供租借燕尾服服务，供您出席正式晚宴及特别场合使用。</p>'), ('17', '15', 'en', 'safe_images/201601/201601181349025643.jpg', '<p>We also provide rental service for you to attend a tuxedo, formal dinners and special occasions.</p>'), ('19', '17', 'zh_cn', 'safe_images/201510/201510081708106062.jpg', '<p>根据个人情况。晕船药?带上一点预防万一，船上基本感觉不到摇晃，只是夜间赶上海 风大的时候，在洗手间里有微微的晃动感，风浪再大点，有时会突然觉得疑似地震的感觉，都是余震感而已</p>'), ('21', '19', 'zh_cn', 'safe_images/201510/201510081709508457.jpg', '<p>北美航程是指所有从美国、加拿大及墨西哥(包括巴拿马运河)港口启航及返航的航程。</p>'), ('29', '25', 'zh_cn', 'safe_images/201510/201510081714255511.jpg', '<p>刷卡\r\n\r\n全部使用美金计算，可以使用的国际信用卡有Visa，Master，American Express，Diners Club和JCB等，但是就是不包括银联，“败们”知道银联是无手续费的。</p>'), ('31', '27', 'zh_cn', 'safe_images/201510/201510081716551969.jpg', '<p>安检及托运\r\n\r\n登船安检时，不允许携带生食(如水果、蔬菜等)，没有正规外包装的食品和酒类也不可以带上船，当然刀具也是不可以，注意，托运也不成，行李限重90公斤。</p>'), ('33', '29', 'zh_cn', 'safe_images/201510/201510081719119381.jpg', '<p>洗漱及生活用品\r\n\r\n如果您是内仓，房间内没有牙膏、牙刷、洗发水、拖鞋。</p>'), ('35', '31', 'zh_cn', 'safe_images/201510/201510081724532663.jpg', '<p>由7声鸣响后1声长鸣组成的一般警报信号是指示您采取行动的唯一警报信号。 当您听到警报拉响，您必须返回船舱，空上救生衣，并前往集合点。</p>'), ('37', '33', 'zh_cn', 'safe_images/201510/201510121545053569.jpg', '<p>为安全起见，我们建议您的护照有效期，不应超出航程终止日期的6个月之内。</p>'), ('39', '35', 'zh_cn', 'safe_images/201510/201510121551528824.jpg', '<p>根据国际海事公约【International Convention of Safety of life at Sea \r\n（SOLAS）】，所有客轮于启航前必须进行安全演习，公约规定所有船上旅客及船员必须出席安全演习，请留意船上广播。所有客舱内均放置有救生指南，客舱\r\n门后亦贴有救生通告和指引，请旅客细阅有关内容。另外每间客舱均备有救生衣，请旅客自行检查救生衣数量是否足够每位旅客使用（包括小童及婴儿），如发现数\r\n量不足，烦请尽快联络房间服务员。</p>'), ('41', '37', 'zh_cn', 'safe_images/201510/201510121553376895.jpg', '<p>当您需要紧急联系您在船上的亲朋好友时，可以拨打邮轮预订中心电话400 920 6666（9:00-19：00）。非工作时间段（19：00—次日09：00），船上的工作人员会第一时间提供帮助。</p>'), ('43', '39', 'zh_cn', 'safe_images/201510/201510121436234495.jpg', '<p><span style=\"color: rgb(57, 57, 57); font-family: &#39;Open Sans&#39;; font-size: 13px; line-height: 18.571428298950195px; background-color: rgb(245, 245, 245);\">无论是室内或室外，日间穿着以短裤、T恤、西裤、休闲裙、衬衫及夏日洋装装扮，最为合适的的。。。！</span></p>'), ('45', '41', 'zh_cn', 'safe_images/201510/201510121600039493.jpg', '<p>邮轮的价格根据邮轮不同的航班、甲板层和不同房型而有所区别。我们的优惠价格包括了邮轮费用，但由于当地政府具体税费经常变化，所以港务税费和船上服务费及其他的消费是不含的。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'), ('47', '43', 'zh_cn', 'safe_images/201510/201510121600378176.jpg', '<p>邮轮船票包括免费餐厅的用餐。邮轮上设有固定的用餐时间，提供早餐，中餐，晚餐，以及24小时的点餐服务（收费项目）。用餐种类有特色自助餐，正宗西餐，您可以根据自己的需求自由选择。同时，除免费餐厅外，邮轮上还提供自费特色餐厅，您可以品尝世界各地的美食。 &nbsp;</p>'), ('50', '17', 'en', 'safe_images/201601/201601181159072034.jpg', '<p class=\"ordinary-output target-output\">According to personal circumstances.<span class=\"\">\r\n Seasickness medicine? With a little precaution, boat basically do not \r\nfeel shaking. Only at night to catch Shanghai wind when, in the bathroom\r\n is slightly shaking feeling, storm is again big point, sometimes \r\nsuddenly feel suspected earthquake feeling, sense of aftershocks</span></p><p><br/></p>'), ('52', '19', 'en', 'safe_images/201601/201601181159399191.jpg', '<p class=\"ordinary-output target-output\"><span class=\"\">North\r\n American flight refers to all from the United States, Canada and Mexico\r\n (including the Panama Canal) and the return voyage sailing port.</span></p><p><br/></p>'), ('54', '27', 'en', 'safe_images/201601/201601181200142386.jpg', '<p class=\"ordinary-output target-output\"><span class=\"\">Security\r\n and check-in boarding security, does not allow carrying raw food (such \r\nas fruits, vegetables, etc.), there is no formal packaging food and wine\r\n may not bring on board, cutting tool of course is not allowed. Note \r\nthat consignments are not into, baggage is restricted weight 90 \r\nkilograms.</span></p><p><br/></p>'), ('56', '29', 'en', 'safe_images/201601/201601181201052132.jpg', '<p class=\"ordinary-output target-output\"><span class=\"\">Wash and daily life if you are in the warehouse, the room no toothpaste, toothbrush, shampoo, slippers.</span></p><p><br/></p>'), ('58', '33', 'en', 'safe_images/201601/201601181344288845.jpg', '<p class=\"ordinary-output target-output\"><span class=\"\">For\r\n the sake of safety, we suggest that your passport is valid and should \r\nnot exceed 6 months from the date of termination of the voyage.</span></p><p><br/></p>'), ('60', '25', 'en', 'safe_images/201601/201601181345142114.jpg', '<p class=\"ordinary-output target-output\"><span class=\"\">All\r\n use of the U.S. dollar credit card, you can use the international \r\ncredit card Visa, Master, Express Diners, Club American and JCB, etc., \r\nbut that does not include the cup, losing people know that the cup is no\r\n fee.</span></p><p><br/></p>'), ('62', '41', 'en', 'safe_images/201601/201601181345515266.jpg', '<p class=\"ordinary-output target-output\"><span class=\"\">The price of a cruise liner varies according to the different flights, decks, and different types of flights.</span><span class=\"\">\r\n Our preferential prices include cruise costs, but due to the local \r\ngovernment specific taxes and fees often change, so the port taxes and \r\nfees and shipping services and other consumption is not included in the.</span></p><p><br/></p>'), ('64', '43', 'en', 'safe_images/201601/201601181346269549.jpg', '<p class=\"ordinary-output target-output\">The dining cruise includes free restaurant. The cruise is provided with a fixed time of meal, breakfast, lunch, dinner, and 24 hours of service (fee item).<span class=\"\"> Have a distinctive style buffet, authentic western style food, you can choose according to their own needs.</span><span class=\"\">\r\n At the same time, in addition to the free restaurant, the cruise also \r\noffers a special restaurant at their own expense, you can enjoy the food\r\n around the world.</span></p><p><br/></p>'), ('66', '7', 'en', 'safe_images/201601/201601181348414098.jpg', '<p><span class=\"\">The\r\n room is 220V and American Standard oubiao two power socket, bathroom \r\nsocket is 110V -220V, don&#39;t forget to bring the conversion plug.</span></p><p><br/></p>'), ('68', '39', 'en', 'safe_images/201601/201601181349574661.jpg', '<p><span class=\"\">Whether\r\n indoor or outdoor, day wearing shorts, T-shirt, trousers, casual dress,\r\n shirts and dresses in summer dress, the most appropriate.</span></p><p><br/></p>');
COMMIT;

