-- ----------------------------
--  Table structure for `vcos_order_pay_log_detail`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_order_pay_log_detail`;
CREATE TABLE `vcos_order_pay_log_detail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_code` varchar(32) DEFAULT NULL COMMENT '会员编号',
  `order_num` varchar(32) DEFAULT NULL COMMENT '订单号',
  `barcode` varchar(32) DEFAULT NULL COMMENT '条形码',
  `price` double(100,0) DEFAULT NULL COMMENT '商品单价',
  `count` int(10) DEFAULT '1' COMMENT '商品数量',
  `count_return` int(10) DEFAULT '0' COMMENT '退货数',
  `status` tinyint(4) DEFAULT NULL COMMENT '1,已支付，2已退货',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=327 DEFAULT CHARSET=utf8;

