BEGIN;
INSERT INTO `vcos_port_detail_language` VALUES ('1', '1', 'zh_cn', '12312321312312312312312312'), ('17', '17', 'zh_cn', '<p>基隆港位于台湾本岛之北端，在富贵角与鼻头角中间。港之东、西、南三面层峦环抱，港口向西北开敞，而向西南湾入内港，成一长约2000公尺，宽约400公尺之狭长水道，兼具军港、商港等多种功能，为北台湾的优良港湾。</p>'), ('19', '17', 'en', '<p class=\"ordinary-output target-output\">Keelung port is located at the northern end of the island of Taiwan, in the rich and pitouchiao middle angle.<span class=\"\">\r\n Hong Kong East, West, South three range upon range of hills surrounded,\r\n port open to the northwest, and to the southwest bay into the inner \r\nharbor, a length of about 2000 meters, about 400 meters long and narrow \r\nchannel width, both naval port, port and other functions, excellent \r\nharbor of Northern Taiwan.</span></p><p><br/></p>'), ('23', '21', 'zh_cn', '<p>该港属温带季风气候，年平均气温夏季约30℃，冬季约-10℃。年平均雾日约40天，冬季有冰，通常不妨碍航　行。全年平均降雨量约1200毫米。属不规则半日潮港，平均潮高为：高潮8.6米，低潮0.4米。<br/><br/></p>'), ('25', '23', 'zh_cn', '<p>基隆市位于台湾岛东北角，三面环山，一面临海，曾是台湾万商云集的重要港口。全市面积133平方公里，人口39. 1万人（2001年底）。为台湾北部重要的国际商港，加上境内岛屿、港湾、山陵兼具，繁华的港都则局促于山海之间，辖下仁爱、安乐、信义、七堵、中山、中 正、暖暖等七个区。</p>'), ('27', '25', 'zh_cn', '<p>基隆港位于台湾岛北端，是台湾北部海上门户，重要的海洋渔业基地。北纬25°09′，东经121°44′，地处台湾省北部的基隆市。港口水深达11.5 米。港口三面环山，沿海湾建有 40 余个泊位。</p>'), ('29', '27', 'zh_cn', '<p>基隆市是台湾开发较早的工业城市，也是台湾最早的省辖市之一, 曾以煤矿开发与港口运输而闻名。随着桃园国际机场的建成、中山高速公路的开通，台湾经济重心向台北县、市发展，基隆发展受到相当大的影响，人口增长呈现停滞状态，工商业发展已不如周边一些新兴市镇。其现代工业主要有造船、化工煤炭、水产加工等。</p>'), ('31', '29', 'zh_cn', '<p>上海市，是中国最大的经济中心和贸易港口，是全国最大的综合性工业城市，也是全国重要的科技中心、贸易中心、金融和信息中心，位于北纬31度14分， 东经121度 29分。</p>'), ('33', '31', 'zh_cn', '<p>上海地处长江三角洲前沿，东濒东海，南临杭州湾，西接江苏、浙江两省，北靠长江入海口，地处我国南北海岸线的中部，交通便利，腹地广阔，地理位置优越，是一个良好的江海港口。境内辖有崇明岛，面积为1041平方公里， 是我国第三大岛。</p>'), ('35', '33', 'zh_cn', '<p>上海地处长江三角洲前沿，东濒东海，南临杭州湾，西接江苏、浙江两省，北靠长江入海口，地处我国南北海岸线的中部，交通便利，腹地广阔，地理位置优越，是一个良好的江海港口。境内辖有崇明岛，面积为1041平方公里， 是我国第三大岛。</p>'), ('37', '35', 'zh_cn', '<p>福冈（Fukuoka），是位于日本九州的北部，福冈县西部的一个重要城市，同时也是福冈县的县厅所在地，属于政令指定都市之一。拥有140万以上的人口是九州地区最大的都市，许多政府机关及公司分社设于此地，和周边的地区共同组成了福冈都市圈。</p>'), ('39', '37', 'zh_cn', '<p>福冈县（Fukuoka-ken），位于日本列岛西部、九州北部，是九州岛上最大的县，是九州政治经济文化的中心。东与山口县相对，西界佐贺县，南邻大分县和熊本县，北面与朝鲜半岛相对。三面临海，交通发达。因靠近朝鲜半岛和亚洲大陆而被称为“亚洲的大门”。自然环境优美，是享乐旅游、徒步旅行、海洋体育等野外活动的好地方。</p>'), ('41', '39', 'zh_cn', '<p>海岸线全长310公里，渔业发达，渔产丰富，捕渔量在日本全国居前列，水产品种类繁多，有着“食在福冈”之美名。印染、纺织机械、食品、水泥、酿造、木材等工业也很发达。农业以大米、小麦为主，小麦产量名列前茅。</p>'), ('43', '41', 'zh_cn', '<p>济州岛的气候，冬季干燥多风，夏季潮湿多雨，年平均气温在16℃左右，夏季最高气温33.5℃，冬季最低气温1℃。济州岛地处北纬33度线附近，却具有南国气候的特征，是韩国平均气温最高、降水最多的地方。济州岛的气候温和，有韩国夏威夷之称。这些都反应了济州岛上朴实的民俗风情。</p>'), ('45', '43', 'zh_cn', '<p>济州岛Jeju Island 过去也写做 Cheju Island，是韩国最大的岛屿，是一座典型的火山岛，世界新七大自然奇观之一。120万年前火山活动而形成，岛中央是通过火山爆发而形成的海拔1950米的韩国最高峰———汉拿山(Mt.Halla)。海洋性气候的济州岛素有“韩国的夏威夷”之称。</p>'), ('47', '45', 'zh_cn', '<p>济州岛（Jeju Island）是韩国最大的岛，又叫做耽罗岛、蜜月之岛、浪漫之岛。济州岛位于东海，朝鲜半岛的南端，在全罗南道西南100公里(60哩)，隔济州海峡与半岛相望，北距韩国南部海岸90多公里，地扼朝鲜海峡门户，地理位置十分重要。面积1825平方公里(705平方哩)。</p>'), ('49', '47', 'zh_cn', '<p>釜山（Busan），全称釜山广域市，位于韩国东南端，是韩国第一港口和第二大城市。南面日本海，与日本对马岛隔海相望，地理位置十分优越，历史上一直是东亚大陆和海洋文化交流的纽带和桥梁。</p>'), ('53', '51', 'zh_cn', '<p>在其海岸线上还沙滩和美丽的海滨风景；城市的周围被连绵的群山所环抱，城市中的温泉星罗棋布。无论是它的山川景色还是它的海洋风光，釜山都会是一处旅游观光的理想之地。</p>'), ('57', '55', 'zh_cn', '<p><span style=\"color: rgb(0, 0, 0);\">首尔（Seoul），全称首尔特别市</span><a style=\"color: rgb(0, 0, 0); text-decoration: underline;\" target=\"_blank\" href=\"http://baike.baidu.com/view/269075.htm\"><span style=\"color: rgb(0, 0, 0);\"></span></a><span style=\"color: rgb(0, 0, 0);\">（서울특별시/서울特别市），韩国首都，国际化大都市，韩国第一大城市，韩国的政治、经济、科技、文化中心，位于韩国西北部的汉江</span><a style=\"color: rgb(0, 0, 0); text-decoration: underline;\" target=\"_blank\" href=\"http://baike.baidu.com/view/47750.htm\"><span style=\"color: rgb(0, 0, 0);\"></span></a><span style=\"color: rgb(0, 0, 0);\">流域，朝鲜半岛</span><a style=\"color: rgb(0, 0, 0); text-decoration: underline;\" target=\"_blank\" href=\"http://baike.baidu.com/view/119146.htm\"><span style=\"color: rgb(0, 0, 0);\"></span></a><span style=\"color: rgb(0, 0, 0);\">的中部。前称汉城</span><a style=\"color: rgb(0, 0, 0); text-decoration: underline;\" target=\"_blank\" href=\"http://baike.baidu.com/view/60891.htm\"><span style=\"color: rgb(0, 0, 0);\"></span></a><span style=\"color: rgb(0, 0, 0);\">，2005年1月19日，汉字名称正式更名为“首尔”。</span></p>'), ('59', '57', 'zh_cn', '<p>首尔是世界设计之都和一个高度数字化的城市，网速和数字机会指数都排名世界第一。消费者物价指数排世界第五，在亚洲仅次于东京。2008年，被《福布斯》杂志列为世界第六大经济城市。</p>'), ('61', '59', 'zh_cn', '<p>首尔是朝鲜王朝600年间的都城，有众多古迹。朝鲜时代的宫殿、宗庙和其他建筑有景福宫、昌德宫、秘苑、昌庆宫、庆熙宫、德寿宫、云岘宫、宗庙、社稷、成\r\n均馆、南大门、东大门、汉城城墙、南汉山城、北汉山城、贞陵、洪陵、宣靖陵、献仁陵、泰康陵等等。</p>'), ('63', '61', 'zh_cn', '<p>香港是一座高度繁荣的国际大都市，是仅次于纽约和伦敦的全球第三大金融中心，与美国纽约、英国伦敦并称“纽伦港”。香港是亚洲重要的金融、服务和航运中心，以廉洁的政府、良好的治安、自由的经济体系以及完善的法制闻名于世，有“东方之珠”、“美食天堂”和“购物天堂”等美誉。</p>'), ('65', '63', 'zh_cn', '<p>大量摩天大楼分布维多利亚港两岸，高度逾90米的建筑超过3000座。全球最高100栋住宅大楼中，最少一半位于香港。香港摩天大楼数目居世界首位。香港的建筑中包括有由美籍华裔建筑师贝聿铭设计的中银大厦，以及由建筑师诺曼·福斯特设计的汇丰银行总行大厦，香港国际机场的建筑设计也出自其手笔。</p>'), ('67', '65', 'zh_cn', '<p>香港岛上的文武庙、铜锣湾天后庙、圣约翰大教堂；九龙的黄大仙祠墓、侯王庙、慈云山观音庙、九龙清真寺；沙田的万佛寺、车公庙、蓬瀛仙馆、半园春、道风山基督教堂；荃湾的竹林禅院、东普陀、荃湾天后庙；龙门的青山寺、青松观、妙法寺；元朗的灵渡寺、云浮仙观；西贡的佛堂天后庙、蚝涌车公庙以及大屿山宝莲寺、长洲北帝庙、坪州天后庙等。</p>'), ('69', '65', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">The &nbsp;man Mo Temple on the island of Hong Kong, Causeway Bay Tin Hau Temple, &nbsp;St. John&#39;s Cathedral; Kowloon Wong Tai Sin Cimu, Hau Wong temple, Tsz &nbsp;Wan Shan Temple of goddess of mercy, Kowloon Mosque; Sha Tin million &nbsp;Buddhist temple, Che Kung Temple, Peng Ying Sen Museum, semi garden &nbsp;spring, windy Hill Christ church; Tsuen Wan Zhu Lin Buddhist temple, &nbsp;Putuo East, Tsuen Wan Tin Hau Temple; the Longmen Mountain Temple, Tsing &nbsp;Chung Koon, Lotus Temple; Yuen Long spirit du Temple, Yunfu Xian Guan; &nbsp;Sai Kung Temple Tin Hau Temple, Ho Chung Che Kung Temple and Lantau &nbsp;Mountain Monastery, Cheung Chau Pak Tai Temple, Ping, Tin Hau Temple.</span></p><p><br/></p>'), ('71', '67', 'zh_cn', '<p>长崎「唐人屋敷」的大门已经成为日本的国家重点文物保护单位。这里的很多街道同中国南方的小镇那样，用石板铺路，搭石板台阶，街道的布局和设计安排像一座迷宫，若没有熟悉的人带路，很容易转晕方向。</p><p>长崎「唐人屋敷」的大门已经成为日本的国家重点文物保护单位。这里的很多街道同中国南方的小镇那样，用石板铺路，搭石板台阶，街道的布局和设计安排像一座迷宫，若没有熟悉的人带路，很容易转晕方向。长崎「唐人屋敷」的大门已经成为日本的国家重点文物保护单位。这里的很多街道同中国南方的小镇那样，用石板铺路，搭石板台阶，街道的布局和设计安排像一座迷宫