-- ----------------------------
--  Table structure for `vcos_restaurant_order`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_restaurant_order`;
CREATE TABLE `vcos_restaurant_order` (
  `order_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) DEFAULT NULL,
  `restaurant_name` varchar(255) DEFAULT NULL COMMENT '餐厅名(根据提交的内容确认)',
  `order_serial_num` varchar(32) DEFAULT NULL COMMENT '订单号',
  `membership_id` int(11) DEFAULT NULL,
  `totale_price` int(11) DEFAULT NULL,
  `pay_type` tinyint(4) DEFAULT NULL COMMENT '支付类型(1余额，2挂账，3到付)',
  `order_check_num` varchar(32) DEFAULT NULL COMMENT '订单校验码',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `order_create_time` datetime DEFAULT NULL COMMENT '订单创建时间',
  `order_status` tinyint(4) DEFAULT NULL COMMENT '订单状态',
  `order_remark` varchar(100) DEFAULT NULL,
  `is_read` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='餐厅订单表';

-- ----------------------------
--  Table structure for `vcos_restaurant_order_detail`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_restaurant_order_detail`;
CREATE TABLE `vcos_restaurant_order_detail` (
  `order_detail_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_serial_num` varchar(32) DEFAULT NULL,
  `restaurant_id` int(11) DEFAULT NULL,
  `food_id` int(11) DEFAULT NULL,
  `food_name` varchar(100) DEFAULT NULL,
  `food_num` int(11) DEFAULT NULL,
  `food_price` int(11) DEFAULT NULL,
  `return_state` tinyint(4) DEFAULT NULL COMMENT '0正常，1退货',
  `remark` varchar(100) DEFAULT NULL,
  `last_change_time` datetime DEFAULT NULL,
  PRIMARY KEY (`order_detail_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

