INSERT INTO `vcos_room_detail_language` VALUES ('1', '1', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">以米色为主色调的海景房，给人一种安静舒适之感。同时，设计巧妙的环绕式<span style=\"line-height: 1.5;\">阳台，也为此处增添了一抹迷人的韵致。</span></span></p>'), ('2', '2', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">这套海景房，拥有大大的落地窗墙，可让您尽览如画的美景。同时，这儿<span style=\"line-height: 1.5;\">的超豪华的阳台、餐椅、按摩浴缸以及沙发，都会让您陶醉其中。</span></span></p>'), ('3', '2', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">The sea view room, a large window wall, allowing you to view the beauty of picturesque.</span><span class=\"\"> At the same time, the ultra luxurious balcony, dining chairs, massage bathtub and sofa, will allow you to enjoy them.</span></p><p><br/></p>'), ('4', '1', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">The beige color of the sea view room, give a person a kind of quiet and comfortable feeling.</span><span class=\"\"> At the same time, cleverly designed around the balcony, but also adds a touch of charming melody here.</span></p><p><br/></p>'), ('9', '5', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">以蓝白为主色调的总统套房，给人一种安静舒适之感。同时，设计巧妙的环绕式<span style=\"line-height: 1.5;\">阳台，也为此处增添了一抹迷人的韵致。</span></span></p><p><br/></p><p><br/></p>'), ('11', '5', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Blue and white as the main tone of the presidential suite, giving a quiet and comfortable feeling.</span><span class=\"\"> At the same time, cleverly designed around the balcony, but also adds a touch of charming melody here.</span></p><p><br/></p>'), ('13', '25', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">海景房均设有观景窗，供您欣赏海上壮丽的美景。总统套房和海景房是最贵的舱房，占地1245平方英尺(约124.95平方米)。其内部的天然木地板、施华洛世奇水晶壁灯以及玻璃马赛克瓷砖等，都尽显皇家气派，奢华无比。</span></p>'), ('15', '27', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\"><span style=\"line-height: 1.5;\">&nbsp;总统舱房均设有观景窗，供您欣赏海上壮丽的美景。总统套房和海景房是最贵的</span><span style=\"line-height: 1.5;\">舱房，占地1345平方英尺(约124.95平方米)。</span></span></p><p><br/></p>'), ('17', '29', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\"><span style=\"line-height: 1.5;\"></span></span><span style=\"font-family:Arial;font-size:16px\">这套双层阁楼套房，拥有大大的落地窗墙，可让您尽览如画的美景。同时，这儿<span style=\"line-height: 1.5;\">的超豪华的阳台、餐椅、按摩浴缸以及沙发，都会让您陶醉其中。</span></span></p><p><br/></p>'), ('19', '31', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp;</span><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">其内部的天然木地板、施华洛世</span><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">奇水晶壁灯以及玻璃马赛克瓷砖等，都尽显皇家气派，奢华无比。</span></p>'), ('21', '33', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">以蓝白为主色调的标准海景房，给人一种安静舒适之感。同时，设计巧妙的环绕式<span style=\"line-height: 1.5;\">阳台，也为此处增添了一抹迷人的韵致。</span></span></p>'), ('23', '35', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">这套双层阁楼套房，拥有大大的落地窗墙，可让您尽览如画的美景。同时，这儿<span style=\"line-height: 1.5;\">的超豪华的阳台、餐椅、按摩浴缸以及沙发，都会让您陶醉其中。</span></span></p>'), ('25', '37', 'zh_cn', '<p><span style=\"color: rgb(51, 51, 51); font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 28px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; float: none; display: inline !important; background-color: rgb(255, 255, 255);\"><span style=\"font-family:Arial;font-size:16px\">客房有的可以合并后成为加大尺寸的双人床，并有相应的室内设备与标准的浴室设备。</span></span></p>'), ('27', '39', 'zh_cn', '<p><span style=\"font-family:Arial;font-size:16px\">有一张双人大床，大部分可转换为两张单人床，一个带淋浴的私人浴室，以及一个书桌，抽屉空间的梳妆台。</span></p>'), ('29', '41', 'zh_cn', '<p><span style=\"font-size:16px\"><span style=\"line-height: 1.5;\">占地1345平方英尺(约124.95平方米)。其内部的天然木地板、施华洛世</span><span style=\"line-height: 1.5;\">奇水晶壁灯以及玻璃马赛克瓷砖等，都尽显皇家气派，奢华无比。</span></span></p><p><br/></p>'), ('35', '47', 'zh_cn', '<p>配有一张双人大床，大部分可转换为两张单人床，一个带淋浴的私人浴室，以及一个书桌，抽屉空间的梳妆台。每间客房内还有恒温控制的空调，直拨电话，迷你酒吧，私人保险箱，吹风机，交互电视，免费欧式早餐，以及24小时客房服务。</p>'), ('37', '49', 'zh_cn', '<p>有一张双人大床，大部分可转换为两张单人床，一个带淋浴的私人浴室，以及一个书桌，抽屉空间的梳妆台。</p>'), ('39', '51', 'zh_cn', '<p>简洁舒服为主，无舱，看不到海，安静。<br/></p>'), ('41', '53', 'zh_cn', '<p>房间没有窗户，面积一般都在15-20平米，配置基本用品。</p>'), ('43', '55', 'zh_cn', '<p>温馨色调，安静偏小，面积一般都在15平米左右。</p>'), ('45', '57', 'zh_cn', '<p>一张大床,大部分可以转换成两张单人床，一个带淋浴的私人浴室和卫生间，宽敞的衣柜空间，以及一个书桌，梳妆台。</p>'), ('47', '53', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Room without windows, the area is generally 15-20 square meters, the basic configuration of the configuration.</span></p><p><br/></p>'), ('48', '55', 'en', '<p>Warm tone, quiet, small, usually around 15 square meters.</p>'), ('50', '57', 'en', '<p>A big bed, most of which can be converted into two single beds, a shower with private bathrooms and toilets, spacious wardrobe, and a desk and dresser.</p>'), ('52', '47', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">One\r\n with a double bed, most conversion for two single beds and a private \r\nbathroom with shower, and a desk, drawer of the dresser.</span><span class=\"\">\r\n Each room and constant temperature control air-conditioning, direct \r\ndial phone, mini bar, private safe, hairdryer, interactive TV, free \r\ncontinental breakfast, and 24 hour room service.</span></p><p><br/></p>'), ('54', '49', 'en', '<p>There is a double bed, most conversion for two single beds and a private bathroom with shower, and a desk, drawer of the dresser.</p>'), ('56', '51', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Simple and comfortable, no cabin, can not see the sea, quiet.</span></p><p><br/></p>'), ('58', '29', 'en', '<p>This double loft suite with big windows wall, lets you overlooking the picturesque beauty. At the same time, the ultra luxurious balcony, dining chairs, massage bathtub and sofa, will allow you to enjoy them.</p>'), ('60', '27', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">The president has a cabin viewing window, for you to enjoy the magnificent beauty of the sea.</span><span class=\"\"> The presidential suite is the most expensive and Seaview cabin, covers an area of 1345 square feet (124.95 square meters).</span></p><p><br/></p>'), ('62', '25', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Sea view rooms are equipped with a viewing window for you to enjoy the magnificent views of the sea.</span><span class=\"\"> The presidential suite is the most expensive and Seaview cabin, covers an area of 1245 square feet (124.95 square meters).</span><span class=\"\">\r\n The interior of the natural wood floor, Swarovski crystal lamp and \r\nglass mosaic tiles and other, fully demonstrated his royal style, \r\nluxurious incomparable.</span></p><p><br/></p>'), ('64', '35', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">This double loft suite with big windows wall, lets you overlooking the picturesque beauty.</span><span class=\"\"> At the same time, the ultra luxurious balcony, dining chairs, massage bathtub and sofa, will allow you to enjoy them.</span></p><p><br/></p>'), ('66', '33', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Blue and white as the main tone of the standard sea view room, give a quiet and comfortable feeling.</span><span class=\"\"> At the same time, cleverly designed around the balcony, but also adds a touch of charming melody here.</span></p><p><br/></p>'), ('68', '31', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">The\r\n interior of the natural wood floor, Swarovski crystal lamp and glass \r\nmosaic tiles and other, fully demonstrated his royal style, luxurious \r\nincomparable.</span></p><p><br/></p>'), ('70', '39', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">There\r\n is a double bed, most conversion for two single beds and a private \r\nbathroom with shower, and a desk, drawer of the dresser.</span></p><p><br/></p>'), ('72', '41', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Covers an area of 1345 square feet (about 124.95 square meters).</span><span class=\"\">\r\n The interior of the natural wood floor, Swarovski crystal lamp and \r\nglass mosaic tiles and other, fully demonstrated his royal style, \r\nluxurious incomparable.</span></p><p><br/></p>'), ('74', '37', 'en', '<p class=\"ordinary-output target-output\"><span class=\"\">Some\r\n rooms can be merged to become to increase the size of a double bed, and\r\n the indoor equipment and corresponding standard bathroom equipment.</span></p><p><br/></p>');
COMMIT;

