room with shower. Equipped with air conditioning, '), ('34', '44', 'zh_cn', 'OW4 海景房（方窗） ', 'room_images/201605/201605301957237324.jpg', '两张单人床（可合并为大床），下拉式的第三四人床位，独立卫生间配备淋浴，梳妆区，配备有电视，小冰箱，保险箱，电话，拖鞋、热水壶等。');
