INSERT INTO `vcos_safe_language` VALUES ('1', '1', 'zh_cn', '安全规定', '<p><span style=\"font-size: 16px;\">本船舶配有最先进的安保设备及系统，符合I.M.O.国际海事组织（International amartime Organization）<span style=\"font-size: 16px;\">颁布的</span>《国际海上人命安全公约》（International Convention for the Safety of Life at Sea）.<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>根据国内外相关规定，船舶设计旨在处理任何类型的紧急事件。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>我们的工作人员均边续参加过高度专业课程，有资质并可妥善处理紧急事件的每个阶段。船上的消防队也接受相关培训，可处理极端情况</span></p><p><br/><span style=\"font-size: 16px;\"></span></p><p><span style=\"font-size: 16px;\">紧急信号由7声鸣响后1声长鸣组成的一般警报信号是指示您采取行动的唯一警报信号。<span style=\"font-size: 16px;\"> &nbsp; &nbsp; &nbsp;&nbsp; <br/></span></span></p><p><span style=\"font-size: 16px;\"><span style=\"font-size: 16px;\">当您听到警报拉响，您必须返回</span>船舱，空上救生衣，并前往集合点。\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size: 16px;\">如果您无回到自己的船舱并且没有救生衣，也不必担心，集合点会提前供备用的成人及儿童救生衣。</span></p><p><span style=\"font-size: 16px;\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size: 16px;\">在您救生衣以及船舱门背面的卡片上清楚地标明了您的集合点以及前往集合点的最佳路线<strong>。</strong>如果您按照船上的绿色信号前进，整个流程将十分简捷。 &nbsp; &nbsp; &nbsp; </span></p><p><span style=\"font-size: 16px;\">\r\n &nbsp; &nbsp; &nbsp; <br/>请尽快前往您的集合点并验证从您的船舱前往集合点的路线。<br/>\r\n &nbsp; &nbsp; &nbsp; <br/>请劳记，当紧急警报拉响时，我们训练有素的工作人员在任何情况下都会站在船上的紧急情况重要位置，为您提供协助，并指引您前往集合点。</span></p><p><span style=\"color:#444444;font-size:16px\"><br/></span><br/></p>'), ('2', '2', 'zh_cn', '救生设备', '<p><span style=\"font-size:16px\">我们为儿童和婴儿提供的小号救生衣置于船舱中。&nbsp;&nbsp; &nbsp; <br/>所有成人救生衣也设计用于超重或身形魁梧的人士；如船上没有大号救生衣，您可在集合点领取延长带以系好安全带，让救生衣穿着舒适服帖。我们为每一位儿童提供一个身份识别手环，手环上标有集合点的位置</span></p>'), ('3', '3', 'zh_cn', '安全介绍', '<p><span style=\"font-size:16px\"></span></p><p><span style=\"font-size:16px\">贴于船舱门背后的标牌上有更多安全信息及指示。&nbsp; <br/></span></p><p><span style=\"font-size:16px\">按照《国际海上人命安全公约》的规定，您在启航前应携带客房内的应急演练卡参加一般紧急情况演练。&nbsp;&nbsp; &nbsp;&nbsp; <br/></span></p><p><span style=\"font-size:16px\">熟悉一般紧急信号&nbsp;&nbsp; <br/></span></p><p><span style=\"font-size:16px\">学会正确使用救生衣&nbsp;&nbsp;&nbsp; <br/></span></p><p><span style=\"font-size:16px\">熟悉紧急状况下的集合点位置、抵达集合点的路线，以及听到警报信号时应采取的行动。</span></p><p><br/></p><p><br/></p>'), ('4', '4', 'zh_cn', '安全指引', '<p><span style=\"font-size:16px\">如有烟雾，请尽可能地弯腰低身前过，以呼吸较为洁净而新鲜的空气，并沿地板上的光带前往最近的完全出口。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>在真正发生紧情况时，救生艇将在登船甲板准备就绪。请谨记这并不意味着要弃船，而是为万一弃船做好必要准务工作。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>弃船指令只限船长口头发出。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>如需弃船，游客必须用一只手搭住前一位的肩，排队前往登艇点。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span><br/></p><p><span style=\"font-size:16px\">船舶上配备的救生艇数量足够全部游客使用。</span></p><p><span style=\"font-size:16px\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size:16px\">也配有充气救生筏可供使用。</span></p><p><span style=\"font-size:16px\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size:16px\">抵达救生艇时，请按工作人员的指示行事。患有残疾的游客将最后登艇，以方便他们上下船。</span></p><p><span style=\"font-size:16px\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size:16px\">如果您在紧急情况时行动不便需要协助，请告知负责接待的工作人员。</span></p><p><br/></p>'), ('5', '4', 'en', 'Safety guidelines', '<p class=\"ordinary-output target-output\">If there is smoke, please as far as possible to bend low before the \r\nbody too, to breathe more clean and fresh air, and along the band on the\r\n floor to recent all exports.</p><p class=\"ordinary-output target-output\">In real tight situation, will be in the lifeboat embarkation deck ready. Please keep in mind that this does not mean to abandon the ship, but what to do the necessary work to abandon the quasi.</p><p class=\"ordinary-output target-output\">The oral instruction for ship.</p><p class=\"ordinary-output target-output\"><span class=\"\">If you need to abandon the ship, visitors must use one hand to live before a shoulder, queuing to the embarkation point.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">The number of lifeboat equipped on the ship is sufficient for all visitors to use.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Inflatable life raft is also available.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Please follow the instructions of the staff when you arrive at the lifeboat.</span><span class=\"\"> Disabled visitors will be the last boat, to facilitate them.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">If you need assistance in case of emergency, please inform the person in charge of the reception.</span></p><p><br/></p>'), ('7', '1', 'en', 'Safety regulation', '<p class=\"ordinary-output target-output\"><span class=\"\">The ship is equipped with the most advanced security equipment and \r\nsystem, in line with the promulgated by the I.M.O. IMO (International \r\namartime organization the international maritime safety of life at \r\nconvention &quot;(International Convention for the safety of life at sea.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">According to relevant regulations at home and abroad, the ship design is designed to deal with any type of emergency.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Our\r\n staff have continued to participate in a highly professional course, \r\nthere are qualifications and can properly handle each phase of the \r\nemergency.</span><span class=\"\"> The ship&#39;s fire brigade also accepted the relevant training, can handle extreme cases</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Only the emergency alarm signal the signal from the 7 acoustic ringing\r\n cry after the 1 general alarm signal which is instructing you to take \r\naction.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">When you hear the sirens, you must return to the cabin air, life jackets, and to set point.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">If you do not have to return to your own cabin and do not have a life \r\njacket, do not have to worry, the collection point will be in advance \r\nfor the backup of the adult and children without a life vest.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">On\r\n the back of your life jacket and on the back of the cabin door, your \r\ncollection points are clearly marked and the best way to go to the set \r\npoint.</span><span class=\"\"> If you follow the ship&#39;s green signal, the whole process will be very simple.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Please go to your collection point as soon as possible and verify the route from your cabin to the rendezvous point.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Please remember, when the emergency alarm, we trained staff in any \r\ncase will standing in a boat on an emergency in an important position, \r\nfor you to provide assistance, and direct you to the assembly point.</span></p><p><br/></p>'), ('9', '2', 'en', 'Life saving equipment', '<p class=\"ordinary-output target-output\">We put small life jackets for children and babies in the cabin.</p><p class=\"ordinary-output target-output\"><span class=\"\">All\r\n adult lifejacket is also designed for overweight or physique burly \r\nperson; if there are no lifejackets for large ships, you can at the \r\nrendezvous receive extended belt to fasten the safety belt, wearing a \r\nlifejacket Futie comfort.</span><span class=\"\"> We provide each child with an identity recognition bracelet, hand ring marked the location of the collection point</span></p><p><br/></p>'), ('11', '3', 'en', 'Security Introduction', '<p class=\"ordinary-output target-output\">There are more safety information and instructions affixed to the door sign on the back of the ship.</p><p class=\"ordinary-output target-output\"><span class=\"\">According to the provisions of the International Convention on the \r\nsafety of life at sea, you should carry the emergency drill in your room\r\n to participate in general emergency drills before sailing.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Familiar with general emergency signal</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Learn to use life jackets</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Be familiar with the location of the set point in the emergency \r\nsituation, the route to the collection point, and the action that should\r\n be taken when the alarm signal is heard.</span></p><p><br/></p>'), ('12', '6', 'zh_cn', '安全广播', ''), ('14', '6', 'en', 'Secure broadcas', '<p>撒的发士大夫阿萨德发撒的发啥的减肥爱抚和安松街烤弹那是否圣诞节过后未付啊睡觉快递费阿斯达反馈鉴定费那是的健康妇女啥快递就不发刷卡的缴费呢啊睡觉快递费吧啊睡觉快递费吧阿萨德加咖啡吧啊睡觉快递费吧啊沙口路的减肥那是的会计法办事的快捷方便啊上课的减肥阿萨德卡减肥费凤飞飞飞凤飞飞凤飞飞凤飞飞飞<br/></p>');
COMMIT;

