ost=\"T\" data-ctm=\"#ctm_ref=hi_0_0_0_0_lst_sr_1_df_ls_1_n_hi_0_0_0\" target=\"_blank\">济州岛华美达广场大酒店</a></h2><p><br/></p>', 'zh_cn'), ('211', '217', '济州新罗酒店', '济州新罗酒店', '1', 'strategy_images/201510/201510111734171968.jpg', null, null, '20000', '韩国', '住宿', '1525252525', '舒适', '<h2 class=\"searchresult_name searchresult_name_hover\"><a href=\"http://hotels.ctrip.com/international/986645.html?CheckIn=2015-10-11&CheckOut=2015-10-12&Rooms=2&childNum=2&PromotionID=&NoShowSearchBox=T&isfull=F&cbn=41&ecp=1001310#ctm_ref=hi_0_0_0_0_lst_sr_1_df_ls_2_n_hi_0_0_0\" class=\"hotel_name\" data-dopost=\"T\" data-ctm=\"#ctm_ref=hi_0_0_0_0_lst_sr_1_df_ls_2_n_hi_0_0_0\" target=\"_blank\">济州新罗酒店</a></h2><p><br/></p>', 'zh_cn'), ('213', '219', '蓬莱卤驴肉', ' 享有“天上龙肉、地下驴肉、蓬莱卤驴肉、天下无敌手”之美誉。', '1', 'strategy_images/201510/201510111437097412.jpg', null, null, '10000', '烟台蓬莱', '鲁菜', '18613784568', '色红、透明，溢香扑鼻，鲜嫩爽口，为下酒佳肴。城乡饭店、餐馆及农贸市场多有销售', '<p>清咸丰七年(1857)蓬莱城南门外黄开基首创，三代专擅，在上海、营口、烟台等地开店经营，颇具名声，享有“蓬莱卤驴肉，天下无敌手”之誉。<br/></p>', 'zh_cn'), ('215', '221', '清蒸加吉鱼', '清蒸加吉鱼是山东地区汉族传统名菜之一，山东沿海盛产加吉鱼。原汁原味，鲜嫩爽口，久食不腻，常作高档筵席之大件菜', '1', 'strategy_images/201510/201510111449049354.jpg', null, null, '6000', '山东烟台蓬莱', '鲁菜', '18617916486', '清蒸加吉鱼是山东地区汉族传统名菜之一，山东沿海盛产加吉鱼。原汁原味，鲜嫩爽口，久食不腻，常作高档筵席之大件菜原汁原味，鲜嫩爽口，久食不腻', '<p>相传，唐太宗李世民东征，来到登州(现在的山东蓬莱)。一天，他择吉日渡海游览海上仙山(现今的长山岛)，在海岛上品尝了长相漂亮味道鲜美的鱼之后，便问随行的文武官员，此鱼何名？群臣不敢胡说，于是作揖答道：“皇上赐名才是。”太宗大喜，想到是择吉日渡海，品尝鲜鱼又为吉日增添光彩，为此赐名“加吉鱼”。</p>', 'zh_cn'), ('217', '223', '蟹壳黄 ', '蟹壳黄因其形圆色黄似蟹壳而得名。蟹壳黄是用油酥加酵面作坯，先制成扁圆形小饼，外沾一层芝麻，贴在烘炉壁上烘烤而成。此饼味美咸甜适口，皮 酥香脆。', '1', 'strategy_images/201510/201510111507256008.jpg', null, null, '700', '上海', '上海小吃', '15628976435', '蟹壳黄因其形圆色黄似蟹壳而得名。蟹壳黄是用油酥加酵面作坯，先制成扁圆形小饼，外沾一层芝麻，贴在烘炉壁上烘烤而成。此饼味美咸甜适口，皮 酥香脆。', '<p>它采用油酥面加酵面制坯，做成扁圆形饼，饼面粘上一层芝麻，贴在炉壁上经烘制而成。馅料有咸有甜，咸的有葱油、鲜肉、蟹粉、虾仁等，甜的有白糖、玫瑰、豆沙、枣泥等。因饼形似蟹壳，熟后色泽如蟹壳背一样深红，所以称为&quot;蟹壳黄&quot;。<br/></p>', 'zh_cn'), ('219', '225', '小绍兴鸡粥', '小绍兴鸡粥是上海地区汉族传统小吃，由三黄鸡、上白粳米辅以各种佐料制成。本粥鸡肉白嫩滑韧鲜美，粥中带绿，颜色鲜亮，营养丰富，是一道滋补佳品。', '1', 'strategy_images/201510/201510111524007750.jpg', null, null, '5000', '上海市小绍兴鸡粥店', '上海小吃', '15647896543', '小绍兴鸡粥是上海地区汉族传统小吃，由三黄鸡、上白粳米辅以各种佐料制成。本粥鸡肉白嫩滑韧鲜美，粥中带绿，颜色鲜亮，营养丰富，是一道滋补佳品。', '<p>该店由一绍兴人创办于1947年，由于创办人和主要操作师傅均系绍兴人，在这儿便形成了一个小小的绍兴人天地，故人们给它取名为“小绍兴鸡粥店”。小绍兴鸡粥就是用鸡汤原汁烧煮成的梗米粥，配以鸡肉和各种作料的一种小吃。<br/></p>', 'zh_cn'), ('223', '227', '高级韩版男装', '高级韩版男装', '1', 'strategy_images/201510/201510160923433666.jpg', null, null, '80000', '济州商业广场', '服装', '312001', '休闲舒适', '<p>看型男的最佳搭配，教你穿出大牌范。新款秋冬轻薄款衬衣，运动元素的活跃，让衣服更具专业与随性。</p>', 'zh_cn'), ('225', '229', '三星单反', '最新款三星单反', '1', 'strategy_images/201510/201510160941465590.jpg', null, null, '1000000', '济州特别自治道济州市乐藕路69新罗免税店', '时尚电子数码', '978978768', '质量好', '<table class=\"Ptable\" cellpadding=\"0\" cellspacing=\"1\" width=\"100%\"><tbody><tr class=\"firstRow\"><td>品牌<br/></td><td>三星<br/></td></tr><tr><td class=\"tdTitle\">颜色</td><td>黑色</td></tr><tr><td class=\"tdTitle\">数码相机类型</td><td>单反</td></tr><tr><td class=\"tdTitle\">机身材质</td><td>工程塑料</td></tr><tr><td class=\"tdTitle\">总像素</td><td>1800万以上</td></tr><tr><td class=\"tdTitle\">有效像素</td><td>1600以上</td></tr><tr><td class=\"tdTitle\">传感器类型</td><td>CMOS</td></tr><tr><td class=\"tdTitle\">传感器尺寸</td><td>22.5×15.0毫米</td></tr><tr><td class=\"tdTitle\">图像处理系统</td><td>Digic 5+</td></tr><tr><td class=\"tdTitle\">短片拍摄</td><td>1920x1080</td></tr></tbody></table><p><br/></p>', 'zh_cn'), ('227', '231', '真皮包', '头层牛皮男式钱包', '1', 'strategy_images/201510/201510160947325149.jpg', null, null, '600000', '济州特别自治道济州市乐藕路69 新罗免税店', '包类', '4365435', '富有设计感的造型和优良的真皮质感', '<p>面料：牛皮（头层）<br/>里料：涤纶<br/>颜色：黑色、啡色<br/>规格：120*95*20mm<br/><br/></p>', 'zh_cn'), ('229', '233', '新鲜水果', '仁川猕猴桃', '1', 'strategy_images/201510/201510161127364386.jpg', null, null, '50000', '仁川甕津县', '特产水果', '8765866', '果肉汁水丰沛甜嫩可口', '<p>主要栽种于韩国南海岸一带，因为只有在年平均气温15℃以上的温暖地区栽种到冬季才不会被冻死。因为栽培方面受到气候的各种限制，所以这种被称为“宝石”的猕猴桃除了韩国本土生产的以外，每年还要从新西兰大量进口。<br/></p>', 'zh_cn'), ('231', '235', '洗发香波', '高丽参滋养洗发香波', '1', 'strategy_images/201510/201510161134053482.jpg', null, null, '30000', '仁川艺术文化的中心地九月洞', '生活用品', '32431431', '无添加防脱发', '<p><strong style=\"word-wrap: break-word;\"><span style=\"word-wrap: break-word;;font-family:宋体\"><span style=\"word-wrap: break-word; font-size: 13.5pt;\">顶级洗发水厂家精心研制的，以韩国天然药材为原料（韩国原产的\r\n高丽人参、九节草、川芎、桑白皮、绿茶、白芷等）熬炼72个小时的韩国顶级品牌。无任何添加剂！不仅防止脱发，还有效于养毛发，使柔弱敏感头皮毛发得到清洁和健康。</span></span></strong></p>', 'zh_cn'), ('233', '237', '时尚韩女装', '牛仔棉布连衣裙', '1', 'strategy_images/201510/201510161137566941.jpg', null, null, '40000', '仁川乐天百货', '服饰', '3324324', '精致时尚', '<p>简洁大方自由组合多元系列化为主，尽情演绎韩国混搭风潮的同时又紧追国际潮流，做工精细面料上乘，细微之处衬托出女性高贵、优雅、时尚、个性的一面！</p>', 'zh_cn'), ('235', '239', '高级女士香水', '馥郁优雅而特别的味道', '1', 'strategy_images/201510/201510161141423483.jpg', null, null, '380000', '仁川机场免税店', '护肤化妆', '576576', '奢华与典雅', '<p>香水以和谐丰富的花香体现了女性魅力之精髓。香水散发出科摩罗群岛的依兰香味，接着包围在富有活力的大马士玫瑰花香之中，最后凸显出茉莉的\r\n温柔香调，华丽甜美的花香散发出女性的魅力，檀木香诠释出和谐的香调，独特而果敢。细长的瓶颈，用金色的领巾围了一周，更加显得高贵不凡。</p>', 'zh_cn'), ('237', '241', '名牌女包', '风格大气，设计利落时尚', '1', 'strategy_images/201510/201510161149238577.jpg', null, null, '300000', '釜山新世界百货店', '皮具包类', '87687', '简约时尚', '<p>水晶和金属配件都分别由专属设计师亲自操刀、定制而生产的，用粉色等柔和色调，金属小扣等标志添加可爱元素，很受年轻女性的喜爱。</p>', 'zh_cn'), ('239', '243', '真皮包', '韩国本土设计师打造出来的品牌', '1', 'strategy_images/201510/201510161353537874.jpg', null, null, '300000', 'BIKERSTARLET清潭洞店，首尔特别市江南区清潭洞96-12F', '箱包系列', '65436576547', '款式新颖设计独特', '<p>BIKERSTARLET”新颖的款式和独特的设计，使得许多时尚达人和明星都成为了它家的常客，在《VOGUE》等杂志也可看到该品牌的最新产品与搭配。LOGO是一只非常小的小机车，几乎看不出来。包款非常简单也不强调LOGO，颜色也基本很低调百搭</p>', 'zh_cn'), ('241', '245', '典雅包包', '外表简洁,功能实用', '1', 'strategy_images/201510/201510161402405323.jpg', null, null, '500000', '清潭旗舰店', '高端箱包', '7654764876', '庄重典雅', '<p>是韩国最具人气，名气的品牌，J.estina主以包包，金饰为标志物件，其标志是一个皇冠，漂亮而又优雅，每一次的新品都能在各大杂志\r\n中掀起热力风潮。J.estina的包包十分高贵而又不乏优雅，“高贵夫人兼并优雅小姐”，这恐怕是最适合的语言了，JESTINA给人\r\n一种芳香脱俗的设计概念，每一次的新品都给人惊喜。</p>', 'zh_cn'), ('243', '247', '女装', '少女独有的青春气息，淡雅的色彩，甜美的款式，无可挑剔的搭配', '1', 'strategy_images/201510/201510161414386998.jpg', null, null, '30000', '釜山江南区新沙洞659-11 ', '服装', '576547656', '甜美清新', '<p><span id=\"ctl00_ContentPlaceHolder1_lbContent\">散发的气质展现出自我的独特魅力，她甜美可爱中不失优雅端庄，是女生上班、约会、外出、逛街的最佳选择！</span></p>', 'zh_cn'), ('245', '249', '背包', '设计极富创造与想象', '1', 'strategy_images/201510/201510161422316977.jpg', null, null, '100000', '釜山麻浦区上水洞86-37三爱大厦1F ', '时尚箱包', '87698769', '兼具童真与复古，又不失优雅与潮流', '<p>以背包的形象作为品牌设计的重点所在，加入很多伦敦元素，设计极富创造与想象，兼具童真与复古，又不失优雅与潮流</p>', 'zh_cn'), ('247', '251', '液晶电视', '液晶电视', '1', 'strategy_images/201510/201510161503044042.jpg', null, null, '500000', '东京秋叶原', '数码电器', '76587658', '高清轻薄', '<p>采用日本原装ASV液晶面板,通过缩小液晶面板上颗粒之间的间距,增大液晶颗粒上光圈,并整体调整液晶颗粒的排布来降低液晶电视的反射,增加亮度、可视角和对比度</p>', 'zh_cn'), ('249', '253', '日本和服', '日本和服', '1', 'strategy_images/201510/201510161516001491.jpg', null, null, '300000', '日本东京涩谷', '服装', '77777777777', '风格豪华绚丽多变', '<p><span style=\"FonT-FAMiLY: 宋体; FonT-siZe: 9pt\">袖是未婚青年女子的礼装。特点是花纹颜色鲜艳夺目，五彩缤纷，长袖翩翩。振袖最能体现青年女子的风华正茂，青春灿烂。</span></p><p style=\"text-align:left; MArGin: 5pt 0cm\"><span style=\"FonT-FAMiLY: 宋体; FonT-siZe: 9pt\">振袖又分为大振袖、中振袖和小振袖。大振袖是未婚小姐出席最隆重仪式场合穿着的礼装。现在在结婚仪式上经常可以看见穿大振袖的新娘。大振袖的袖长为114CM。成人节和毕业典礼的小姐盛装是中振袖，新年或参加隆重宴会时也往往穿中振袖。中振袖袖长为95CM。女孩子在参加茶会和宴会等比较轻快的聚会时，穿着小振袖。小振袖的袖长为85CM。振袖的袖子越长，格调和级别就越高。</span></p><p style=\"text-align:left; MArGin: 5pt 0cm\"><span style=\"FonT-FAMiLY: 宋体; FonT-siZe: 9pt\">振袖的花纹突出华丽的特点，大多采用绘描、绞染、型染等工艺，图案有百花、牡丹、花蛤、彩扇、熨门束等，色彩大多浓烈鲜艳。</span></p><p><br/></p>', 'zh_cn'), ('251', '255', '索尼单反', '索尼单反', '1', 'strategy_images/201510/201510161531527286.jpg', null, null, '800000', '日本东京桥高岛屋百货', '数码电器', '47654764654', '质量优良技术先进', '<table id=\"JparamTable\" class=\"paramTable\" summary=\"详细参数\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\"><tbody><tr class=\"firstRow\" itemid=\"9753559\"><th>相机类型</th><td><p><em style=\"z-index: 99;\"><a class=\"poptxt\" href=\"http://product.pconline.com.cn/dc/c5288/\" target=\"_blank\">单反数码相机</a></em>,SLT(半透明固定反光镜)相机</p></td></tr><tr itemid=\"9753560\"><th>相机画幅</th><td><p><em style=\"z-index: 99;\"><a class=\"poptxt\" href=\"http://product.pconline.com.cn/dc/c12012/\" target=\"_blank\">全画幅相机</a></em></p></td></tr><tr itemid=\"9753561\"><