INSERT INTO `vcos_travel_schedule_language` VALUES ('5', '11', 'zh_cn', '午夜电影', '楼层6', '<p>&nbsp;<span style=\"font-family:Arial;font-size:16px\">对于觉得生活无味的人来说电影向来是提供新鲜和刺激的梦幻媒体。《三街剧场》中一个过着索然\r\n无味生活的少女迎来了超越想象的梦幻体验。主人公小丹的梦幻体验和快乐时光也将一扫观众们的枯燥情绪。这些白天在剧场中做事晚上变成鬼魂载歌载舞的样子和\r\n奇怪的舞姿，怪异的歌声充满了新鲜的想像。</span></p>', '刺激的梦幻媒体'), ('7', '13', 'zh_cn', '音乐欣赏', '楼层5', '<p>&nbsp;&nbsp; <span style=\"font-family:Arial;font-size:16px\">这里的剧场版原声音乐质量非常高，且有部分TV组OST难以寻找到的动画音乐包含在内！这足以让喜欢音乐的人们沸腾了，那么今天让我们做音乐的欣赏者，就让这些天籁萦绕耳边，带着愉悦的心情进入音乐的天堂</span>。</p>', '音乐的天堂'), ('9', '15', 'zh_cn', '互动抽奖游戏', '第三层甲板尾部', '<p>精美的邮轮纪念礼品，以及其他的中华泰号纪念奖品等着您！千万不要错过哦！！&nbsp;\r\n 请认真写调查问卷，我们会从填写完整的调查部卷中抽取幸运的游客，恭候您的参与和支持！<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>紧接着.......</p><p>请您与我们的娱乐团队一起狂欢！</p><p><br/></p>', '中华泰号精美奖品等着您'), ('11', '17', 'zh_cn', '披萨制作', '第七层甲板', '<p>在七层泳池吧由我们专业的厨师教您好何制作美味的披萨。</p>', '制作美味披萨'), ('13', '19', 'zh_cn', '欢乐海舞厅', '第六层甲板', '<p><span style=\"font-family:Courier;color:#444444;font-size:16px\"><span style=\"font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255); display: inline ! important; float: none;\"><span style=\"font-family:Arial\">当夜幕降临后这里将变为狂欢之地，空气中充满着兴奋与刺激的气氛，音乐、舞蹈、霓虹灯，还有不可缺少的酒精，让您甩掉所有烦恼，放开所有束缚与压力。</span></span></span></p>', '狂欢之地'), ('15', '21', 'zh_cn', '梦幻海剧场', '第七层甲板', '<p><span style=\"font-family:Arial;font-size:16px\">浪漫云端般的视觉感受。<br/>我们专业的歌手及舞蹈赏为您倾情奉献轻哥曼舞的精彩表演！<br/>还有各类综艺演出随后让你享受视觉大餐！</span></p>', '享受视觉大餐'), ('17', '23', 'zh_cn', '魔术教学', '第六层甲板', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp;&nbsp; 想知道魔术是怎么变出来的吗？我们的魔术大师今天会向您揭晓，请您准备时前往 \r\n泳池吧近距离见证魔术大师的魔术魅力和风采 \r\n！魔术教学旨在向学员介绍各种魔术原理，通过教学启发学生想象力，从而自己创造出自己的魔术。“魔术教学”和“魔术揭秘”&nbsp;无论从词组的本意还是魔术界所\r\n表达的意思看这都是两个有着不同概念的词语。魔术教学不等于魔术揭秘，魔术揭秘也不等于魔术教学。</span></p>', '近距离见证魔术大师的魔术魅力和风采 '), ('19', '25', 'zh_cn', '经典民族风', '第七层甲板欢乐海舞厅', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp;精彩绝伦的舞蹈和甜歌天后迷人的歌声是多彩夜晚的开始。经典民族风为您带来的是具有浓浓民族韵味的节目。</span><br/><span style=\"font-family:Arial;font-size:16px\">独特的傣族舞蹈，真正深入地展示出中华民族深厚的文化底蕴和民族情谊。变脸是中国的国粹精华，这种运用在川剧艺术中塑造人物的特技，层出不穷的变换脸谱可让您惊叹不已。而家喻户晓，可悲可泣的梁祝舞蹈，邀请您一同感受梁祝的凄美爱情，愿天下有情人终成眷属！</span><br/></p>', '民族韵味'), ('21', '27', 'zh_cn', '船长见面会', '七层甲板', '<p>在第七层甲板的阳光海泳池，热带风情的装饰风格为主，让您在享受海风和日光浴的同时，又会有一种身临热带国域感觉。<br/>在这里，船长与您真情相约！<br/>请您穿着正装出席我们为您精心准备的船长见面鸡尾酒会，同时还可以与我们的航海英雄们一起合影！</p>', '与船长合影'), ('23', '29', 'zh_cn', '午夜电影', '楼层6', '<p>&nbsp;<span style=\"font-family:Arial;font-size:16px\">对于觉得生活无味的人来说电影向来是提供新鲜和刺激的梦幻媒体</span></p>', '徜徉电影世界'), ('25', '31', 'zh_cn', '音乐欣赏', '楼层5', '<p><span style=\"font-size:16px\"><span style=\"font-family:Arial\">&nbsp;这里的剧场版原声音乐质量非常高，且有部分TV组OST难以寻找到的动画音乐包含在内！这足以让喜欢音乐的人们沸腾了，那么今天让我们做音乐的欣赏者，就让这些天籁萦绕耳边，带着愉悦的心情进入音乐的天堂</span></span>。</p>', '高雅音乐享受'), ('27', '33', 'zh_cn', '音乐节', '甲板层六层', '<p>摇滚电台荷尔蒙电台将在海上打造现实版的海盗电台，六位当家主播会和音乐节的参与者零距离接触，并力邀中国著名摇滚乐歌手郑钧、全球最具影响力的电子音乐\r\n人之一、国际重磅音乐人麦当娜御用的英国作曲大师、90年代英国电音复兴运动的核心人物Howie \r\nB，中国电子乐教父倪兵，国内顶尖雷鬼音乐人蒋亮和众多国内外知名DJ点燃你的夏日激情。</p>', '伴着海潮听音乐'), ('29', '33', 'en', 'yiinyuejie', 'jiamenk', '<p class=\"ordinary-output target-output\"><span class=\"\">Rock &nbsp;radio hormone radio will build the reality version of pirate radio in &nbsp;the maritime and six headed anchor and Music Festival participants zero &nbsp;distance contact, and invited the Chinese famous rock singer Zheng Jun, &nbsp;the world&#39;s most influential electronic music one of, the heavy music &nbsp;wheat Donna queen of British composers, 1990s British electronic music &nbsp;revival movement of the core characters Howie B, China electronic music &nbsp;Godfather Ni soldiers and domestic top Reggae musician Liang and many &nbsp;domestic and foreign well-known DJ ignite your passion in summer.</span></p><p><br/></p>', 'jt'), ('31', '35', 'zh_cn', '丰盛烤肉', '甲板二', '<p>在海上吃一顿美味的自助烧烤，炎炎夏日，邮轮海上，吹着凉爽的海风，吃着美味的烤肉，享受着自由的度假时光。让您在海面上，也能够品尝到美味的烧烤盛宴。</p>', '海上烤肉、海鲜'), ('33', '35', 'en', 'kaorou', 'two_deck', '<p></p><p>hh</p><p><br/></p>', 'haixian'), ('37', '39', 'zh_cn', '歌剧表演', '三层甲板', '<p>喜欢歌剧的旅客朋友们，可以来这里观赏舞者和歌者的表演，集聚感受</p>', '视觉和听觉的双重冲击，震撼你的心灵'), ('43', '45', 'zh_cn', '歌舞表演', '六层舞台', '<p>顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶东风呜呜呜呜呜呜呜呜呜呜为非阿萨德飞凤飞飞反复为鹅鹅鹅鹅鹅鹅饿鹅鹅鹅饿<br/></p>', '意大利风俗的'), ('45', '47', 'zh_cn', '水电费', '阿萨德发', '<p>水电费<br/></p>', '萨芬'), ('48', '50', 'zh_cn', '烟火', '7', '<p>123<br/></p>', '烟火'), ('50', '39', 'en', 'Opera performance', 'Three deck', '<p class=\"ordinary-output target-output\"><span class=\"\">Love opera visitors and friends, you can come here to watch the dancers and singers performing, gathering experience</span></p><p><span class=\"\">Love opera visitors and friends, you can come here to watch the dancers and singers performing, gathering experience</span><span class=\"\">Love opera visitors and friends, you can come here to watch the dancers and singers performing, gathering experience</span><span class=\"\">Love opera visitors and friends, you can come here to watch the dancers and singers performing, gathering experience</span><span class=\"\">Love opera visitors and friends, you can come here to watch the dancers and singers performing, gathering experience</span></p>', 'The double impact of vision and hearing, shock your mind'), ('52', '25', 'en', 'Classic national wind', 'Seventh deck joy sea dance hall', '<p class=\"ordinary-output target-output\"><span class=\"\">Wonderful dance and sweet song Diva attractive song began colorful night.</span><span class=\"\"> Classic national wind for you to bring a strong national flavor of the program.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Unique dance of the Dai nationality, the deep cultural heritage of the Chinese nation and the national friendship.</span><span class=\"\"> &nbsp;Face is the quintessence of Chinese culture essence, this use of in &nbsp;Sichuan Opera Art in shaping the character of stunts, emerge in an &nbsp;endless stream transform Facebook allows you to marvel.</span><span class=\"\"> Is well known, sad cry butterfly dance, invite your together feel the &nbsp;butterfly lovers of the beautiful love, wish the world lovers get &nbsp;married!</span></p><p><br/></p>', 'National appeal'), ('54', '29', 'en', 'Midnight movie', 'Floor 6', '<p class=\"ordinary-output target-output\"><span class=\"\">For people who think that life is tasteless, the film has always been a dream of providing fresh and exciting media</span></p><p><br/></p>', 'Wander the movie world'), ('56', '27', 'en', 'Captain meeting', 'Seven deck', '<p class=\"ordinary-output target-output\"><span class=\"\">In the seventh deck sunshine sea pool, tropical decoration style is &nbsp;given priority to, let you in to enjoy the sea breeze and sunlight bath &nbsp;at the same time, and there will be a proximity tropical country domain &nbsp;feeling.</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Here, the captain and your true feelings!</span></p><p class=\"ordinary-output target-output\"><span class=\"\">Please you dress attend our for you carefully prepare the captain meet &nbsp;cocktail party, also can be a group of our sailing heroes and!</span></p><p><br/></p>', 'A photo with the captain'), ('58', '50', 'en', 'Fireworks', 'deck7', '<p>&nbsp;everyone is happy to whating the firework. so let&#39;s go.<br/></p>', 'Fireworks is good.');
