-- ----------------------------
--  Table structure for `vcos_wifi_compensation_log`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_wifi_compensation_log`;
CREATE TABLE `vcos_wifi_compensation_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `wifi_order_id` int(11) NOT NULL COMMENT 'wifi订单id',
  `membership_id` int(11) DEFAULT NULL COMMENT '会员id',
  `membership_code` varchar(32) DEFAULT NULL COMMENT '会员号',
  `wifi_compensation_name` varchar(50) DEFAULT NULL COMMENT '补偿名',
  `wifi_compensation_service_time` int(11) NOT NULL COMMENT 'wifi补偿时间 时间长度 以秒为单位 1*60=1分钟',
  `wifi_compensation_apply_time` int(11) NOT NULL COMMENT '申请时间',
  `wifi_compensation_apply_remark` varchar(100) DEFAULT NULL COMMENT '补偿备注',
  `wifi_compensation_state` tinyint(4) NOT NULL DEFAULT '0' COMMENT '1:失败,2:成功,3:使用完',
  `create_by` varchar(50) DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `vcos_wifi_connect_log`
-- ----------------------------
DROP TABLE IF EXISTS `vcos_wifi_connect_log`;
CREATE TABLE `vcos_wifi_connect_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `membership_id` int(11) DEFAULT NULL,
  `membership_code` varchar(32) DEFAULT NULL,
  `wifi_service_name` varchar(100) DEFAULT NULL,
  `wifi_time` int(11) DEFAULT '0' COMMENT 'wifi时间',
  `ip_address` varchar(32) DEFAULT NULL,
  `mac_address` varchar(32) DEFAULT NULL,
  `wifi_login_time` int(11) DEFAULT NULL,
  `wifi_logout_time` int(11) DEFAULT NULL,
  `wifi_online_time` int(11) DEFAULT NULL COMMENT '在线时长',
  `certification_result` varchar(32) DEFAULT NULL COMMENT '认证结果',
  `exit_reason` varchar(100) DEFAULT NULL COMMENT '退出原因',
  `exit_type` tinyint(4) DEFAULT NULL COMMENT '退出类型，0当前在线,1正常退出，2主动退出，3异常退出',
  `wlanacip` varchar(32) DEFAULT NULL,
  `ssid` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `un_mid_id` (`membership_id`,`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `vcos_wifi_connect_log`
