-- ----------------------------
--  View structure for `vcos_member_crew`
-- ----------------------------
DROP VIEW IF EXISTS `vcos_member_crew`;
CREATE ALGORITHM=UNDEFINED DEFINER=`rock`@`%` SQL SECURITY DEFINER VIEW `vcos_member_crew` AS select `vcos_member`.`member_id` AS `member_id`,`vcos_member`.`sign` AS `sign`,`vcos_member`.`cn_name` AS `cn_name`,'1' AS `member_type`,`vcos_member`.`passport_number` AS `passport_number`,`vcos_member`.`member_code` AS `member_code` from `vcos_member` union all select `vcos_wifi_crew`.`crew_id` AS `member_id`,`vcos_wifi_crew`.`sign` AS `sign`,`vcos_wifi_crew`.`cn_name` AS `cn_name`,'2' AS `member_type`,`vcos_wifi_crew`.`passport_number` AS `passport_number`,`vcos_wifi_crew`.`crew_code` AS `member_code` from `vcos_wifi_crew`;

-- ----------------------------
--  Triggers structure for table user
-- ----------------------------
DROP TRIGGER IF EXISTS `myupdate`;
delimiter ;;
CREATE TRIGGER `myupdate` BEFORE UPDATE ON `user` FOR EACH ROW BEGIN
if NEW.username!=OLD.username THEN
	SET NEW.authKey=MD5(NEW.username);
	END if;
END
 ;;
delimiter ;

delimiter ;;
-- ----------------------------
--  Triggers structure for table vcos_member
-- ----------------------------
 ;;
delimiter ;
DROP TRIGGER IF EXISTS `mysign`;
delimiter ;;
CREATE TRIGGER `mysign` BEFORE UPDATE ON `vcos_member` FOR EACH ROW BEGIN
	if NEW.member_code!=OLD.member_code THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.member_code),MD5(NEW.passport_number),MD5(NEW.member_password)));
	END if;
	if NEW.passport_number!=OLD.passport_number THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.member_code),MD5(NEW.passport_number),MD5(NEW.member_password)));
	END if;
	if NEW.member_password!=OLD.member_password THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.member_code),MD5(NEW.passport_number),MD5(NEW.member_password)));
	END if;
END
 ;;
delimiter ;

delimiter ;;
-- ----------------------------
--  Triggers structure for table vcos_wifi_crew
-- ----------------------------
 ;;
delimiter ;
DROP TRIGGER IF EXISTS `mycrewsign`;
delimiter ;;
CREATE TRIGGER `mycrewsign` BEFORE UPDATE ON `vcos_wifi_crew` FOR EACH ROW BEGIN
	if NEW.crew_code!=OLD.crew_code THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.crew_code),MD5(NEW.passport_number),MD5(NEW.crew_password)));
	END if;
	if NEW.passport_number!=OLD.passport_number THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.crew_code),MD5(NEW.passport_number),MD5(NEW.crew_password)));
	END if;
	if NEW.crew_password!=OLD.crew_password THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.crew_code),MD5(NEW.passport_number),MD5(NEW.crew_password)));
	END if;
END
 ;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
